(1, 1, 'CASE', 1, 'VGDC');
INSERT INTO `notes_master` (`note_id`, `title`, `description`, `patient_id`, `clinic_id`) VALUES
(1, 'Test', 'hello', 71, 1),
(10, 'demo', 'test', 15, 1),
(11, 'test', 'dddd', 71, 1),
(12, 'Behaviour and cognitive aspects', 'she is doing well in cognitive activity', 28, 1),
(13, 'Apollo Testing Note', 'Testing.... msg', 71, 1),
(14, 'Activities', 'work on hand grip , attitude of walking \n\nupper limb strength\n* Fine motor tools \n* hand strengthening \n* hand weight bearing game \n* over head ball throwing \n* small beads game \nlower limb strength \n* heel walking  fruits \n* side walking \n* standing - flexion ,Abduction \n* stretching - tc , hams \n* Ball tracing with hand and squat', 38, 1),
(15, 'Activities', 'improve shoulder muscle strength \nwork on grip\n* hand wrap - sh external rotation elbow pronation  IR\n* glide - Ant - infe \n* stretching - sh , elbow , wrist \n* weight with sh flexion, side lying abduction , horizontal elbow flexion , extension , lateral rotation \n* Scapular muscle strengthening-Y.t exs \n* cubital fossa massage & machine gun \n* ES - group elbow- flex, ext \n* point electrodes lumbricals - 90 cont \n* weight bearing on affected limb- forearm support, hand walking', 40, 1),
(16, 'Activities', 'work on proper walking \n\n* stretching \nhams, cuff , quads, knee to chest \nactive hams stretching \n* kneel trunk rotation \n* treadmill walk \n* stepping up \n* forward bend \n* ball standing', 50, 1),
(17, 'Activities', 'work on attitude on limb \nproper walking \n\n* Stretching muscles that are tight- tc , hamstring, knee flexor, elbow flexors, sh extensor, rotators \n* treadmill \n\n* Step standing reachouts posterolat direction\n* Sit to stand from blue stool\n* Kneeling overhead reachouts\n-Upper body and lower body dissociation exercises..\n* pelvic rotation \n* arm support \n* hand weight bearing \n* kneel standing \n* step up standing \n* slop walk \n\n-Use prowraps...wrap around one upper limb and another lower limb\nDistal to proximal till tummy', 14, 1),
(18, 'Activities', 'gait improvement\n=reduction of wrist stiffness \n\nankle moment , static \nhip- flexion , abduction \nknee- flexion extension ( supine) \nknee flexors stretch ( prone )\nhigh sitting extension \nmini squat\none leg standing \nhurdle walk\nwobble board weight shift , squat \nstep up \n\n# lower end or radius fracture \nwrist mobilization \nulnar, radial glide \nwrist dorsal , volar glide\nwrist flexor, extensor stretch \nwrist circulation with traction \nfist making \nwax therapy', 63, 1),
(19, 'Activities', 'Increase strength ul &ll \nPain reduction \n\ncore activation \n* bridging \n* crunch \nlower limb strengthening\n* ATM\n* hip flexion with 1 kg weight \n* hip abduction \n* knee flexion \n* sitting knee extension \n* heel toe weight shifting \n* matching\nupper limb strengthening - lt sh pain \n* shoulder active moment with stick \n*  sh flexion multi angle weight hold \n* sh abduction weight hold \n* abducted arm circulation \nhand strengthening - complain can’t able to hold saree drape \n* finger curls \npain therapy \n* TENS', 35, 1),
(20, 'activities', 'Avoid unnecessary hand movements \n. To improve eye contact\n.Not letting her to zone out \n\npicking clips from rope \nbalance exs - chair hurdle walk \n                        balance beam activity \n kneel on swinging and take clips', 19, 1),
(21, 'progression', 'Work on his memory and speech ( start with nouns) Continue with heavy props and vestibular tasks', 12, 1),
(22, 'test', 'hi', 50, 1),
(23, 'Hello', 'Good', 133, 1),
(24, 'note', 'demo text', 1, 1),
(25, 'note', 'demo text', 1, 1),
(26, 'note', 'demo text', 1, 1),
(29, 'Physio', 'Goal - improve weight bearing on right, improve release function of hand, increase dorsiflexion, decrease back extension which occurs with shoulder flexion, decrease lateral rotation \n\n>Step standing on balance board, with weight in hands\n>Core (abs) activation with shoulder flexion (in supine or hanging)\n>Toe touching in long sitting for dorsiflexion and breaking the pattern \n>Hip abductors strengthening with theraband\n>Calf and quadratus lumborum stretching \n>Fine motor (pincer release)\n>walking on balance beam', 17, 1),
(28, 'Physio', 'Goal - increase weight bearing on left, decrease anterior pelvic tilt \n\n\n>Half kneeling and posterolateral reachouts\n>Ladder supported standing and hip flexion \n>Supine 90-90 with red ball in hand \n>Treadmill - Back walk, hand walk \n>Iliopsoas, quadratus lumborum stretching \n>Glutes and core (abs) strengthening \n>Duck walk \n>Step standing on balance board and over-head reachouts', 37, 1),
(30, 'OT', 'Goal - Identification, Improve brain engaging, improve response to auditory command, oral \n\n>Flashcards \n>Continuous brain engaging activities \n>Oral massage, hickey \n>Massage gun', 22, 1),
(31, 'OT', 'Goal - Increase sitting tolerance and command following, increase touch response and body awareness, oral \n\n>Oral massage with his own lotion, oral vibrator, hickey\n>Activities on the balance board, like puzzle ball, giggles, shape sorter, tray, etc.\n>Different textures exposure \n>Massage gun \n>Tray or any activity with him inside the standing barrel', 20, 1),
(32, 'OT', 'Goal - Brain engaging, oral \n\n>Copy shapes (straw and binder)\n>Beading with standing on swing \n>Jumping with clips \n>Colour sort or any activity with alternate hand movements \n>Shape a thon \n>Knowledge bank\n>Oral massage, oral vibrator, hickey', 28, 1),
(33, 'OT', 'Goal - Decrease her impulsiveness, increase command following and eye contact, grip\n\n>Prop on hands\n>Rhymes on cues provided \n>Physical challenging activity with multitasking \n>Time bound activities (with stop watch)\n>Give complex commands, so that she have to listen attentively.\n>For eye contact - copy facial expressions\n>Sit silently with eyes closed', 25, 1),
(34, 'Physio', 'Goal - improve functional ROM, improve balance and ambulation on different surfaces, work on transitions\n\n>Treadmill (front, back, side and hand walk)\n>Position holds (half kneeling on mat, step standing on balance board)\n>Floor sit to standing \n>Slope \n>Stairs\n>Swing', 57, 1),
(35, 'Physio', 'Goal - decrease lateral rotation of leg, increase dorsiflexion and prevent further calf spasticity, improve weight bearing, dissociation, hand function and supination \n\n>Treadmill \n>Stretching (calf, wrist flexors & pronators, quadratus lumborum)\n>Fine motor \n>Activities in half kneeling, step standing \n>Toe touching with dorsiflexion in long sitting \n>Walking on balance beam', 5, 1),
(36, 'Session plan', '* For 15 minutes, give her favourite activity, observe her behaviors, make corrections if she misbehaves.\n* Faccilate communication throughout the session  for better rapport formation.\n* For another 20-25 minutes, give activities but not according to her preferences, set times for the performance pressure, observe if she behaves inappropriately, goal is to break her stubborn ness.\n* Last 5-10 minutes, make her seat quietly, observe the behaviours.', 18, 1),
(37, 'Session plan', '• For initial 15 minutes, communicating with her, inquiring about her routine or anything, she often raises her voice so reminding her whenever she does so\n• next 25-30 minutes, cognitive activities like 9 pieces puzzle, wooden blocks puzzle, checking if she talks irrelevant things while doing the activities and correcting her\n• last 15 minutes, revising common shapes, colours, animals, birds, veges, fruits. Give her more time than usual and help her if she fails', 38, 1),
(38, 'session plan', '* Making him seat for the initial 15-20 minutes, observing his restlessness, giving him frequent instructions firmly to conduct himself according to the situation.\n* He likes flowers, leting him play with them if he behaves accordingly, he likes to play on his own way so in between ask him to follow your conditions(\"now make blue flower\")\n* Last 5-10 minutes, make him sit without any activity, dont give commands, just observe his restlessness and other behaviours.', 48, 1),
(39, 'session plan', '• 5 minutes break as she usually comes after the PT session, try communicating with her in this break.\n• shape board , flowers or any other activity, make her do the activities as quickly as she can, she tends to do it with her comfortable pace so push her\n• sometimes becomes aggressive so firmly correct her \n• basic flashcards for speech like alphabets, animals etc. make it more interactive', 19, 1),
(40, 'Activities', 'Aditya\n\nImprovements: repetitions of words is reduced,\nCognitive function has improved,\nStubbornness is reduced.\n\nActivities:\nPuzzles solving\nIntroducing the what cards\nHurdle walking', 33, 1),
(41, 'activities', 'Aditya\n\nImprovements: repetitions of words is reduced,\nCognitive function has improved,\nStubbornness is reduced.\n\nActivities:\nPuzzles solving\nIntroducing the what cards\nHurdle walking', 55, 1),
(43, 'Activities', 'Arohi\n\nActivities:trunk rotation witg rings\nSide sitting reach outs with rings\nCurl ups\nSuperman pose on ballster with rings\nHand weight bearing\npush ups\nSit to stand\nBall or ballster supported standing \nHip flexion on walker\nTreadmill walking \nknee extension in high sitting \nStretching: adductors illiopsoas\n\n\nAlternate day\n\nActivities:trunk rotation with the help of rings\nSide sitting reach outs with rings\nCurl ups\nSide walking outside\nHand weight bearing\nPush ups\nStretching: adductors ,illiopsoas', 23, 1),
(44, 'Activities', 'Vihana\n\nImprovements- verbal communication improved\nEye contact improved\n\nWork on- \nMotor planning ,Dual task, fine motor,  cognitive planning and problem solving\nActivities-\nJump and remove Clips\nWalking on balance beam\nBeading with 2 colour pattern\nHand weight bearing ( tredmill handwalk)\nWhat and why questions', 29, 1),
(46, 'Follow up by Bhagyashree mam', 'Kriyansh\nImprovements-\nBetter weight bearing on legs\nPostero lat balance improved \nHip knee flexion attitude reduced\nQuadriceps and gluteus recruitment improved\n\nTreatment plan-\nWork to improve degrees of freedom\nPostural control and better muscular facilitation \nImprove walking pattern\n\nActivities-\n1)Step standing on green stool\nwith posterolateral reachouts\n2) step up and down on chair\n3) standing holding onto red wand (placed on stool)\n4) standing holding on to red wand,pertube on all directions, for balance and recruitment of muscles.\n5)hand weight bearing and rotational reachouts unilateraly.\n6) Walking with chair ( frequent change of directions)', 50, 1),
(47, 'Activities:', 'work on neck tonic reflexes \nsupine on ball and throwing in basketball \nweight on hand activity \ndouble task', 43, 1),
(48, 'follow up by jahnavi ma\'am', 'olfactory desensitisation (with different smells)', 22, 1),
(49, 'follow up by bhagyashree ma\'am', 'prowrap', 25, 1),
(50, 'Krishna\'s OT', 'Goal - decrease restlessness, speech and memory (nouns)\n\n>Treadmill (with one kg weights and weighted jacket) back walk 2 mins, front running 2 mins, hand walk with his legs on stool 4 mins\n>Trampoline jump with 1 kg ball - catch and throw\n>Sitting still with eyes closed and hands fold\n>Physical with cognitive aspect \n>Beads on dynamic surfaces \n>Jumping with clips \n>Responding to auditory command - give only verbal cues without action\n>Figure of 8 ball rolling\n>Noun memory and speech clarity (flashcards)', 12, 1),
(51, 'OT', 'Goal - work on complex transitions, multitasking, memory, improve reaction time, cognitive problem solving, improve response to auditory commands\n\n>Complex hurdles \n>Activities with treadmill, swing, etc to improve reaction time \n>Complex auditory commands\n>Rings with stick for problem solving', 26, 1),
(52, 'Follow up by Bhagyashree mam', 'For upper limb proprioception give Theraband or wraps while task', 19, 1),
(53, 'OT plan', 'Goals- Improve flexibility with respect to activity and increase sitting tolerance and time\n\nActivities-No fixed protocol \nPuzzle ball, Shape sorter, wodden tray, clips, Ball pick up and put, theraputti or rice rajma  for tactile, Visual tracking with lights in Beakers.\nAll above activities with physical challenging positions like walking uphill on sensory mats, ball sitting , bolster step up and walk, walking on beam.\n\n-Hand weight bearing and Prop for hand ( try prowraps for upper limb)', 16, 1),
(54, 'OT plan', 'Goal: Improve ability to follow multi-step instructions and complete tasks independently in structured settings.\n\nActivities \nOn swing- shape sorter, wodden stack of squares\nColour sorting with pegs and cones\nWodden tray\nBall collection from floor while walking on textured mats\n2 kg ball pick up, throw and kick.', 11, 1),
(55, 'OT plan', 'GOAL-\nIncrease functional use of upper limb.\nInprove degress of freedom\nImprove visual exploration\n\nActivities \nHand weight bearing\nHand to hand transfer activities\nRemove clips from t shirt and pant\nRotational activity for degress of freedom\nWorking on spherical grip ( rings,pegs)\nClimbing up and down ladder and hanging.\nTactile stimulation to palm\nVisual tracking with cups.\nFlash cards on light box.', 57, 1),
(57, 'March', 'therapy plans', 65, 1),
(58, 'March', 'therapy plans', 27, 1),
(59, 'Occupational therapy protocol', 'Goal :\nstay focused and avoid distractions \nimprove attention in multitasking \n\nActivities: \n\n* eye patching for concentration \n* hurdle walking \n* foam or rajama ke sath number writing \n* puzzle solving\n* kneel walk on mattress towards question answer \n* bekar trac', 27, 1),
(60, 'Special education (April)', 'Cognition:-*Months,Week,about her self, her address, shapes, colours and parts of body \n*Drawing/Patterns/colours/picture Drawing \n*Peace puzzle \n\nBehavior:-*Improve discipline \n           *Command/Instruction/Request following \n\nAcademic:-*1 to 100 numbers in Gujrati (recognition/reading  and writing)\n*1digit Addition(Gujrati)\n*Missing/after numbers (Gujrati)\n*Bigger and smaller numbers(Gujrati)', 18, 1),
(61, 'Special education (April)', 'Socialization:-*Mix with other kids/people \n*Give and take Toys & Material (sharing with others)\n\nCommunication:-*Story telling by flash cards\n*Daily talk about her day/schedule/school/event \n\nCognition:- * 4 peace puzzle \n                    * Cube puzzle \n                    *Join the dots and make objects and colour it. \n*Months/Week name/Shapes/Colours/Fruits/About her self/her address \n                     \nAcademic:- (Oral part)*Letter identification (capital letters)\n* Number identification (1-20)\n(Written part)*A to Z\n                        *1 to 20\n                       *Count and write (1-10)', 38, 1),
(62, 'Special education (April)', 'Socialization:-*Mix with other kids/people \n*Give and take Toys & Material (sharing with others)\n\nCommunication:-*\n*Daily talk about her self/Shapes/colors/fruits name/week names /parts of body\n\nCognition:- * 9 to 15 peace puzzle \n                     \nAcademic:- (Oral part)*Letter identification (capital letters)\n* Number identification (1-15)\n(Writing part)*Standing and sleeping lines (dot to dot joining)\n\nFine motorskills:-*Scribbling/coloring', 37, 1),
(66, 'Special education (April)', 'Socialization:-*Mix with other kids / people \n                         *Competitive games/Educational games \n\nCommunication:-*Say hi/hello/bye & common talk with other kids/people \n*Talk about her daily routine/about her self/school/home/events\n\nCognition:-*Puzzle 12 to 24 peace\n                *Object matching \n                  *Letters/Numbers matching \n                 * activity for concentration (colouring /drawing)\n\n\nAcademic:- *CVC words in English \n                       *In Maths numbers (1 to 100 )/missing numbers/after and before numbers \n                         *1 digit Addition', 43, 1),
(67, 'Special education (April)', 'Communication:-*Basic talks like about his self/school/home/events \n                                 *Talk with other kids/people \n\n\nSocialization:-*Mix with other kids /people \n\nCognition:-*10 to 15 peace puzzle \n                     *Dot matching \n                       *pattern/colour/drawing/object matching \n\nAcademic:-*Identification (1 to 10)/A to Z [capital letters]\n                *Dot to dot make standing/slanting & sleeping lines', 26, 1),
(68, 'special education', 'Cognition:-*Logical/critical thinking worksheets \n*Find the path/puzzles \n*patterns/Shapes/objects finding &colouring \n*Coding/decodig\n\nAcademic:-*3 letter words (CVC)in written part \n*3/4 letter words & small sentences (oral part)\n*Name of the King of vegetables, animals, birds, fruits & about golden words\n\nCommunication:-*Common talk/day history', 25, 1),
(69, 'Physiotherapy Plan', 'Goal- Kesar should stand independently without support. Kesar should walk 2- 3 steps independently.\n\nActivities \n-one leg standing\n- sit to stand from a low stool\n- squat to stand on different texture \n- promote forefoot weight bearing\n- step standing Rotational reachouts\n- plank hold and with upper limb reachouts\n- tredmill walking \n- standing holding onto a red wand\n- walking facilitation', 64, 1),
(70, 'OT plan', 'Goal- Improve focus and attention \n    Work on tactile issues\n\nActivities \n- Beading with pattern while standing on swing\n- Lycra swing activity \n- tredmill hand walk\n- tactile modulation with rolling on different textures\n- Any one activity with foam/ flowers/ water. \n- A cognitive activity (dice and count game/ what ques) with auditory distraction with 2 songs playing simultaneously', 36, 1),
(71, 'OT plan', 'Goals\n1)Improve command following and better cooperation to complete tasks independently in structured settings.\n2)Improve cooperation with mother at home\n\nActivities \n1)On swing- shape sorter, wodden stack of squares\n2)Colour sorting with pegs and cones\n3)Sitting on mat- wodden trays, puting coins.\n\n4)Ball collection from floor while walking on textured mats\n5)Putting chole or rajma in box\n6)Home program advised for better gel up with mom', 11, 1),
(75, 'Occupational Therapy Protocol-(April)', 'Treatment goal: \n* work on attention , command following  \n* eye contact and improve orientation to environment \n\nActivities: \n* kneel walk on mattresses towards question answer\n* clip or wooden tray activity on swing \n* simple command following stand up -sit down \n* climbing with boll and put in basket', 27, 1),
(74, 'Occupational Therapy Protocol- ( April)', 'Improvements : \n* improvement on hand muscle strength \n* eye -hand coordination \n\nTreatment Plan:\n* Strengthen tripod , semi round and precision grip\n* Address toe walking and muscle tightness\n\nActivities:\n* 5 min close eyes sitting \n* Theraputty exercises \n* treading small beads \n* lifting pompom boll with clips \n* calf and hamstring muscles stretch \n* tandom walking on balance beam with boll on hand', 38, 1),
(76, 'Occupational Therapy Protocol-(April)', 'Improvements: \n* improvement in eye contact \n* command following \n* less  distractions while activities \n\nTreatment goal : \n* enhance eye contact \n* attention  to activity and \n* work on walk attitude (swayback) \n\nActivities:\n* beaker tracing \n* imitation , ryme \n* hurdle walk shadow matching activity \n* balance beam walk without giving rest - wooden tray', 19, 1),
(77, 'Occupational Therapy Protocol-(April)', 'Treatment goals: \n* improve attention in activity\n* reduce hyperactivity \n* improve sitting ability \n\nTreatment plan\nActivities-\n- Wrap in towel and provide vibration and Prop with Swiss ball\n- Textured mat walking with one tray.\n- Tredmill hand walk/ Wobbel board plank position with reachouts\n- Light box in dark room show animal cards\n- Lycra swing ring activity \n- Tactile activity with harrsh textures( rice,petals,Sand)\n- Teach colour concept', 148, 1),
(78, 'Occupational Therapy Protocol-(April)', 'Improvements-\nBetter weight bearing on legs\nPostero lat balance improved \nHip knee flexion attitude reduced\nQuadriceps and gluteus recruitment improved\n\nTreatment plan-\nWork to improve degrees of freedom\nPostural control and better muscular facilitation \nImprove walking pattern\n\nActivities-\n1)Step standing on green stool\nwith posterolateral reachouts\n2) step up and down on chair\n3) standing holding onto red wand (placed on stool)\n4) standing holding on to red wand,pertube on all directions, for balance and recruitment of muscles.\n5)hand weight bearing and rotational reachouts unilateraly.\n6) Walking with chair ( frequent change of directions)', 50, 1),
(79, 'Physiotherapy Plan', 'Khushi\nGoal- \nImprove body alignment and posture\nImprove right lower limb weight bearing \n\nActivities-\n- tredmill back walk, side walk\n- step ups ( front and sideways both)\n- Rotations while sitting on ball\n- Obliques activation\n- Active stretching for back and quadratus lumborum with sidelying on vestibular ball\n- modified plank \n- Sit to stand and sqaut to stand with more weight bearing on rt side.\n- Rt upper limb( fracture side) Active movements of shoulder, elbow and wrist in pain free range.', 13, 1),
(80, 'OT plan', 'Neelkanth-\nGOAL-\nIncrease functional use of upper limb.\nInprove degress of freedom\nImprove visual exploration\n\nActivities \nHand weight bearing\nHand to hand transfer activities\nRemove clips from t shirt and pant\nRotational activity for degress of freedom\nWorking on spherical grip ( rings,pegs)\nClimbing up and down ladder and hanging.\nTactile stimulation to palm\nVisual tracking with cups.\nFlash cards on light box.', 57, 1),
(81, 'occupational Therapy Protocol (April)', 'Improvements:\n* increased weight-bearing on lower limb \n* improved  trunk extension \n\nTreatment goal : \n*  work on attitude of limb \n* walking pattern \n* stretching of tight muscles \n\nActivities: \n* stretching of upper and lower limb muscles \n* Arm support Activity \n* crawling exercise \n* lungs with wooden tray \n* sit to stand up \n* slop walk \n* Hurdle walk', 14, 1),
(82, 'occupational Therapy Protocol (April )', 'Treatment Goal :\n \n* enhance overall grip \n* improve ulnar grip \n* strengthen shoulder and scapular muscles\n\nActivities: \n\n* hand wrap - sh external rotation elbow pronation  IR\n* glide - Ant - infe \n* stretching - sh , elbow , wrist \n* weight with sh flexion, side lying abduction , horizontal elbow flexion , extension , lateral rotation \n* Scapular muscle strengthening-Y.t exs , punching exercises in supine \n* cubital fossa massage & machine gun \n* ES - group elbow- flex, ext \n* point electrodes lumbricals - 45cont \n* weight bearing on affected limb- forearm support\n* sand , rice activity for grip \n* boll throwing activity with both hand \n* clips activity on swing', 40, 1),
(83, 'OT plan', 'Goals\n- Reduce fixation and sequencing pattern.\n- improve sitting tolerance.\n- Improve motor planning \n\n\nActivities\n-Activities with challenges to improve problem solving.\n-Light box cards\n-Circuit for prop and tactile modulation\n-tactile Play for tactile registration.\n-Any activity on swing or Wobble board for attention and focus\n-Lycra swing\n( Frequent change of Activity and puzzles)', 16, 1),
(84, 'OT/SI protocol', 'Aaditya\n\nActivities:puzzles solving\nClip removing from rope with jump\nHurdle walking with different trays at both ends\nDual tasking activity \nWhat why questions\nImmitations', 33, 1),
(85, 'OT/SI protocol', 'Sparsh\n\nActivities:\nActivities which he liked in sitting to improve sitting tolerance\nTreadmill\nTrampoline\nDark room :eye tracing with beakers', 147, 1),
(86, 'OT/SI protocol', 'Sharv:\n\nActivities :\nHurdle walking with ankle weights at higher surface \nHand weight bearing with activities (activities which are at his cognitive level)\nSqueezing water in glass (with sponge)\n\nSuggestions by bhagyashree maam.\nHanging\nProp for upper limn\n(Prowraps,hanging,weight bearing on hands)\nClips\nThera putty\nAdd such activities that gives prop to upper limb.', 143, 1),
(87, 'PT protocol', 'Arohi\n\nImprovements:quad strength has improved \nTone  is  reduced in both upper limb as well as lower limb.\n\n\n\nActivities:trunk rotation witg rings\nSide sitting reach outs with rings\nCurl ups\nSuperman pose on ballster with rings\nHand weight bearing\npush ups\nSit to stand\nBall or ballster supported standing \nStanding with knee 5-10 degree flexed\nQuad strengthening on chair (stepping up and down\nTreadmill walking \nknee extension in high sitting \nStretching: adductors\n\n\nAlternate day\n\nActivities:trunk rotation with the help of rings\nSide sitting reach outs with rings\nCurl ups.\nStanding with knee 5-10 degree flexed\nQuad strengthening on chair (stepping up and down)\nSide walking outside\nHand weight bearing\nPush ups\nStretching: adductors', 23, 1),
(101, 'Physiotherapy Protocol ( April)', 'Improvements :\n* Improved neck control\n* Better trunk extension and control\n* Improved eye contact\n* Able to bear weight on knees\n* Better at expressing himself\n\nTreatment Goals:\n* To improve weight-bearing capacity\n* To achieve independent standing and walking\n\nActivities: (Hold each position for 10 seconds, repeat 3 times)\n* Cross-legged sitting\n* Side-sitting\n* Quadruped position (on hands and knees)\n* Kneel-standing position\n* Passive range of motion exercises and stretching for both upper and lower limbs', 69, 1),
(89, 'Follow up by Bhagyashree mam (April Protocol)', 'Improvements-\nBetter Speech, better weight bearing, Improved bilateral coordination.\n\nGoals-\n- work on degrees of freedom \n- work on alignment and posture\n- work on fine motor\n- Improve balance\n\nAdd-\n- any activity on swing\n- Dissociation and rotation of upper and lower body.( Rotational reachouts, step standing reachouts)\n- Facilitate activities for Quadriceps recruitment.\n- Add fine motor clips, beads, theraputti.\n- strengthening of back extensors in closed chain position', 14, 1),
(90, 'follow up by jahnvi mam & bhagyashree mam', 'Putty, clay\nMotor planning activities', 22, 1),
(91, 'follow up by jahnavi mam', 'quads strengthening', 17, 1),
(92, 'physio', 'Weight bearing \nTransitions', 10, 1),
(93, 'self input', 'fast walking on treadmill with heel down, and reverse handwalk', 5, 1),
(94, 'follow up by jahnavi mam', 'hand printing with water colour', 20, 1),
(95, 'OT/SI protocol', 'Vihana\nImprovements- verbal communication improved\nEye contact improved\n\nWork on- \nMotor planning ,Dual task, fine motor,  cognitive planning and problem solving\nActivities-\nJump and remove Clips\nWalking on balance beam\nBeading with 2 colour pattern\nHand weight bearing ( tredmill handwalk)\nWhat and why questions', 29, 1),
(96, 'SI/OT Protocol', 'Viaan\nImprovements : color identification \nVerbal response\n\nActivities \nFinding objects with color specifications\nPuzzle ball on equilibrium board\nTrays\nAsking questions', 60, 1),
(97, 'follow up by jahnavi mam', 'high physical activity', 22, 1),
(98, 'follow up by jahnavi mam', 'activities on standing frame, like pressing the ball behind the upper back, kicking the ball, overhead activity, etc.', 37, 1),
(99, 'Follow up by Bhagyashree mam', 'Observations-\nSeems irritated for any activity\nIs cranky while doing task, Visual stimming with hand and finger flicking is increased.\n\nActivities-\nTry Frequent change of task and Activities \nAdd water play , water colour play. Try patient guided session,\nIncrease the level of puzzles, to improve complex problem solving', 27, 1),
(100, 'occupational Therapy Protocol by Bhagyashree mam', 'OT plan\nGoals-\n1)Work on inter drive and interest to play with the therapist\n2)Work on his sitting tolerance to finish a task\n3) Use tactile and Prop to improve attention.\n\nActivities-\n- remove rings from horizontal stick and stack them together.\n- clips on clothes\n- pushing toys or things from a small table in all the directions.\n- Picking up of things and sort them.\n- Give and take Actions with mother.\n- Tracking with Beakers\n- Any one tactile activity ( petals, rice or sand)\n- balancing on swing', 69, 1),
(103, 'Special education (May)', 'Socialization:-*Mix with other kids/people \n*Give and take Toys & Material (sharing with others)\n\nCommunication:-*\n*Daily talk about her self/Shapes/colors/fruits name/week names /parts of body\n\nCognition:- * 9 to 15 peace puzzle \n                     \nAcademic:- (Oral part)*Letter identification (capital letters)\n* Number identification (1-15)\n(Writing part)*Standing and sleeping lines (dot to dot joining)\n*Dot to dot making letter A\n*Colour in specific area\n\nFine motorskills:-*Scribbling/coloring \n                   \n*Learning slogan of N.R.Narayanmurti(Mera Bharat Mahan)', 37, 1),
(107, 'Special education (May)', 'Socialization:-*Mix with other kids / people \n                         *Competitive games/Educational games \n\nCommunication:-*Say hi/hello/bye & common talk with other kids/people \n*Talk about her daily routine/about her self/school/home/events,body parts, common colours, shapes, king of fruits, vegetables, animals, water animals, birds, National symbols (Flag, Song, Anthem,bird,animal, flower, river,game,fruit, currency, tree),about traffic lights and their work,about seasons\n\nCognition:-*Puzzle 12 to 24 peace\n                *Object matching \n                  *Letters/Numbers matching \n                 * activity for concentration (colouring /drawing)\n\n\nAcademic:- *CVC words in English \n          *Working on small sentences & blend words \n                       *In Maths numbers (1 to 100 )/missing numbers/after and before numbers \n*Number names (1 to 10)\n                       *Concept of article (a/an)\n*preparing for the play role of Kasturba Gandhi', 43, 1),
(111, 'Special education (May)', 'Cognition:-*Months,Week,about her self, her address, shapes, colours and parts of body,vegetables name,fruits name,golden words, water animals, birds, wild animals, pet animals, domestic animals,National flag-Tiranga(colour also)\n*Drawing/Patterns/colours/picture Drawing \n*9 Peace puzzle \n\nBehavior:-*Improve discipline \n           *Command/Instruction/Request following \n\nAcademic:-*1 to 100 numbers in Gujrati (recognition/reading  and writing)\n* Simple two digit Addition(Gujrati)\n*Missing/after numbers (Gujrati)\n*Bigger and smaller numbers(Gujrati)\n*Learning slogan of Rani Laxmi bai(मैं अपनी झांसी किसी को नही दूंगी)', 18, 1),
(106, 'Special education (May)', 'Communication:-*Basic talks like about his self/school/home/events,colours,fruits, shapes,parts of the body,home address \n                                 *Talk with other kids/people \n\n\nSocialization:-*Mix with other kids /people \n\nCognition:-*10 to 15 peace puzzle \n                     *Dot matching \n                       *pattern/colour/drawing/object matching \n\nAcademic:-*Identification (1 to 10)/A to Z [capital letters]\n                *Dot to dot make standing/slanting & sleeping lines\n*Dot to dot  making A to z\n*Learning slogan of Bhagat Singh(Inkalab Jindabad)', 26, 1),
(108, 'Art class', 'working on colouring, sketching and craft work                                 \nLearning slogan of Mahatma Gandhi (My life is my message)', 47, 1),
(109, 'Art class', 'working on colouring, sketching and craft work                                 \nLearning slogan of Lal Bahadur Shastri(Jai Jawan Jai Kisaan)', 48, 1),
(110, 'Special education (May)', 'Cognition:-*Logical/critical thinking worksheets \n*Find the path/puzzles \n*patterns/Shapes/objects finding &colouring \n*Coding/decodig\n\nAcademic:-*3 letter words (CVC)in written part \n*3/4 letter words & small sentences (oral part)\n*Name of the King of vegetables, animals, birds, fruits & about golden words\n*1 to 100 numbers (Missing, before, after, between)\n*Big and small numbers \n*Number names (1 to 5)\n*National symbols (Flag,Song, Anthem,animal,bird, currency, fruit, tree,game)\n\nCommunication:-*Common talk/day history\nLearning slogan of Sarojani Naidoo (We are free people,the white men should not rule over us)', 25, 1),
(112, 'Special education (May)', 'Socialization:-*Mix with other kids/people \n*Give and take Toys & Material (sharing with others)\n\nCommunication:-*Story telling by flash cards\n*Daily talk about her day/schedule/school/event \n\nCognition:- * 4 peace puzzle \n                    * Cube puzzle \n                    *Join the dots and make objects and colour it. \n*Months/Week name/Shapes/Colours/Fruits/About her self/her address \n                     \nAcademic:- (Oral part)*Letter identification (capital letters)\n* Number identification (1-20)\n(Written part)*A to Z\n                        *1 to 20\n                       *Count and write (1-10)\n*Learning slogan of Jhansi ki rani Laxmi bai(I am the queen of Jhansi)', 38, 1),
(113, 'Special education (May)', 'Cognition:-*Months,Week,about her self,  address, shapes, colours and parts of body,vegetables name,fruits name,golden words, water animals, birds, wild animals, pet animals, domestic animals,National flag-Tiranga(colour also)\n*Drawing/Patterns/colours/picture Drawing \n*9 to 25 Peace puzzle \n\nBehavior:-*Improve discipline \n           *Command/Instruction/Request following \n\nAcademic:-*1 to 100 numbers (recognition/reading  and writing)\n* Simple two digit Addition \n*Missing/after numbers\n*Bigger and smaller numbers\n*Aa to Zz (recognition/reading &writing with Cursive)\n*Two & Three letter words \n*Learning slogan of Subhash Chandra bose(तुम मुझे खुन दो,मैं तुम्हे आज़ादी दूंगा)', 46, 1),
(114, 'parent discussion', 'better response to name, self laugh and cry- gut issues                                    unclear speech , fruit washing, cream application', 147, 1),
(115, 'Physio plan( May 2025)', 'Naksh\nImprovements-\nBetter thumb abduction and oppsition\nBetter foot placement in stance phase\n\nGoals-\nImprove individual finger and thumb movements \nImprove supination and triceps activation.\nReduced lat rotation of leg\n\nActivities \n-on wedge lunges and squats to promote active stretch.\n-stepping and reachouts\n-Sensory stimulation to foot\n-Ig and SF for ankle DF and Thumb Abduction.\n-Hand weight bearing reachouts\n-Tredmill\n-Trunk dissociation and rotations\n-fine motor activities and activities to improve supination.', 5, 1),
(116, 'Physiotherapy Plan May 2025', 'Improvements-\nRt upper limb is better now, can take weight\n\nGoal- \nImprove body alignment and posture\nImprove right lower limb weight bearing \n\nActivities-\n- tredmill back walk, side walk\n- step ups ( front and sideways both)\n- Rotations while sitting on ball\n- Obliques activation\n- Active stretching for back and quadratus lumborum with sidelying on vestibular ball\n- modified plank \n- Sit to stand and sqaut to stand with more weight bearing on rt side.\n-Side sitting reachouts with rt upper limb weight bearing.\n-Mat exercises to facilitates core and obliques with red swiss ball\n-Half kneel to kneel repetations.', 13, 1),
(117, 'OT plan', 'Improvements-\nEnvironmental awareness improved\nEye contact is now more susutained\nCommand following js better\n\nGoals\n- Reduce fixation and sequencing pattern.\n- improve sitting tolerance.\n- Improve motor planning \n\n\nActivities\n-Activities with challenges to improve problem solving.\n-Light box cards\n-Circuit for prop and tactile modulation\n-tactile Play for tactile registration.\n-Any activity on swing or Wobble board for attention and focus\n( Frequent change of Activity and puzzles)', 144, 1),
(118, 'Physiotherapy Plan May 2025', 'Improvements-\nBetter core stability\nBetter registeration to sound \nEye contact little better\n\nGoals-\nBetter postural alignment and stability\nImprove muscular recruitment and co-contraction\nWork on distal weakness in upper limb and lower limb.\n\nActivities-\n-weight bearing Activities with pediwraps.\n( side sitting, kneeling, quadriped,supperman)\n- Prowraps for tummy \n- supine to sit facilitation \n- Standing with upper limb support\n- step standing', 10, 1),
(119, 'OT plan May 2025', 'Goal-\nAahan should try to reachout for a toy\nMaintain optimal arousal\n\nActivities-\nTactile input with ball and small sensory mats.\nBeakers tracking in dark room\nLight box cards\nWhile standing on frame, try to do hand function like give and take\nAssisted bimanual throwing and catching of ball', 10, 1),
(120, 'Physiotherapy May 2025', 'Improvements-\nBetter standing balance\n\nGoals- \nImprove degress of freedom\nImprove endurance \n\nActivities-\n- Stretching of elbow flexors, hip flexors, hams and TA, trunk rotational stretch\n- supine on red ball,with upper limb reachouts\n- side lying on ball with reachouts for side opening of rib cage.\n- spine extension facilitation\n- half kneel rotational reachouts with one hand weight bearing.\n- tredmill back ,side and front walk', 14, 1),
(121, 'OT & PT May Protocol', 'Treatment goals: \n\n* combine Ot and pt protocol for better improvement \n* Enhance weight bearing capacity on limbs through activities \n* focus on posture control\n* Encourage active participation in activities (play with the therapist)\n* Work on his sitting tolerance to finish a task\n* Use tactile and Prop to improve attention.\n\n\nActivities: \n\n* Removing rings from horizontal stick \n* Removing clips on clothes \n* Cross-legged sitting with wooden square pyramid\n* Side sitting with hand weight with Dominos given take with mother \n* Krishna position with one any activity \n* Kneel standing -try actively kneel sitting to stand \n* quadruped position \n* pushing toys or things from a small table in all the directions.\n* Picking up of things and sort them \n* Tracking with Beakers\n* Any one tactile activity ( petals, rice or sand)\n* balancing on swing\n* Passive range of motion exercises and stretching for both upper and lower limbs', 69, 1),
(122, 'Occupational Therapy Protocol- May', 'Improvement \n* his taking interest in task \n* better eye contact \n* better command following \n\nTreatment goals: \n* Reduce Hyperactivity and improve sitting tolerance \n\nActivities: \n* Tactile activity with harrsh textures( rice,petals,Sand)\n* Textured mat walking with one tray.\n* Hand weight bearing with ring activity \n* Light box in dark room show animal cards\n* Lycra swing with ring activity \n* Teach colour concept', 148, 1),
(123, 'Occupational Therapy Protocol-May', 'Treatment goals: \n* Strengthen tripod , semi round and precision grip\n* Address toe walking and muscle tightness\n\nActivities:\n* 5 min close eyes sitting \n* Theraputty exercises - Rolling, pulling, finger squeezing,\n* treading small beads \n* lifting pompom boll with clips \n* striking -small beads \n* Hand weight bearing activity \n* push up \n* calf and hamstring muscles stretch \n* tandom walking on balance beam with boll on hand\n* deep squat \n* heel walk with one tray', 38, 1),
(124, 'OT & PT Protocol-May', 'Treatment goal : For OT \n* visual exploration \n* cognitive development\n\nActivities\n* bekar tracing \n* Rings remove from horizontal stick \n* boll throwing in standing \n* given and take objects with mom\n* clips removing form own clothes \n\n\nTreatment goals:  For PT \n* Work to improve degrees of freedom\n* Postural control and better muscular facilitation \n* Improve walking pattern\n\nActivities-\n1)Step standing on green stool\nwith posterolateral reachouts\n2) step up and down on chair\n3) standing holding onto red wand (placed on stool)\n4) standing holding on to red wand,pertube on all directions, for balance and recruitment of muscles.\n5)hand weight bearing and rotational reachouts unilateraly.\n6) Walking with chair ( frequent change of directions)\n7)boll activity-Standing ( for quds recruitment ) \n8)stretching - tc , hamstrings, quads \n9)trunk rotation in kneel with rings', 50, 1),
(125, 'occupational Therapy Protocol-May', 'Treatment goals:\n* make him Happy and actively engage him in activity\n* focus on command following \n\nActivities-\n* Try Frequent change of task and Activities\n* Taking rings with stick and sorting \n* shape making with clay, \n* water play -  like coins transfer with spoon or pompon squeeze \n* patient guided session\n* Increase the level of puzzles, to improve complex problem solving', 27, 1),
(126, 'occupational Therapy Protocol-May', 'Treatment goals : \n* Command following \n* problem solving tasks \n* enhance attention span of tasks \n* imitation \n* work on postural awareness\n\nActivities: \n* boll throwing with diff height surface \n* hurdle walk with shape sorters \n* crawl walking through tunnel \n* Tunnel activity with rings \n* beads', 65, 1),
(127, 'OT plan for May 2025', 'Improvements-\nBetter sitting tolerance\nCommand following is improved\n\nGoals-\nImprove environmental awareness\nImprove socialisation\nImprove problem solving \nRemove fixation in a task\n\nActivities \n-Sitting on a tyre swing put ball in the basket\n- shape sorter with shapes in a rod\n- tunnel travel\n- Heavy prop hurdle task with weights ( square ring stacker)\n- Tactile play ( lotion, prowraps, vibrator)\n- removing stickers from body\n- theraputti', 147, 1),
(128, 'OT plan May 2025', 'Improvements-\nTactile issues seems to be resolved\n\nGoals-\nImprove focus and attention \nMinimal auditory and visual distraction \nImprove eye contact\n\nActivities-\nAny heavy prop activity with swing\nPencil rolling in a barrel\nHurdle walk and jump\nHolding on to the bolster swing\nTredmill hand walk\nLycra swing with rings', 36, 1),
(129, 'OT plan May 2025', 'Goal-\nFacilitate upper limb movements with appropriate sensory stimulation \n\nActivities \nSitting on CP chair, prowraps to upper limb\nRings\nPeg board\nWollen pom pom balls\nWater with coins\nAny heterogeneous tactile activity- rice, or petals\nTry bimanual upper limb big yellow ball holding', 45, 1),
(134, 'occupational Therapy Protocol-May', 'Treatment goal : \n* increase weight bearing on left side \n* improved gait pattern \n* improve lower extremity coordination and control \n\nActivities \n* standing frame activity- on Step standing reachouts , step up - down \n* core strengthening- 90-90 crunches , boll holding \n* weight shifting in lungs and side lunges \n* duck walk with one game \n* Half kneeling and posterolateral reachouts\n* kneel sit to stand with boll throwing into basket \n* Ladder supported standing and hip flexion \n* Supine 90-90 with red ball in hand and knees\n* Iliopsoas, quadratus lumborum stretching', 37, 1),
(131, 'OT plan May 2025', 'Goal-\nFacilitate upper limb movements with appropriate sensory stimulation \n\nActivities \nSitting on CP chair, prowraps to upper limb\nRings\nPeg board\nWollen pom pom balls\nWater with coins\nAny heterogeneous tactile activity- rice, or petals\nTry bimanual upper limb big yellow ball holding.', 45, 1),
(133, 'occupational Therapy Protocol-May', 'Treatment goals: \n* enhance down seeing eye movement \n* core activation \n* postural correction \n\nActivities: \n* Fig of 8 wraps tommy to shoulder \n* Hurdle walking with tray \n* clips on box and putting on rope\n* squat on beam balance and talking objects \n* hand walk on treadmill \n* crawling  walk in barrel tunnel and one activity', 19, 1),
(135, 'occupational Therapy Protocol-May', 'Improvement:\n* shoulder joint range improved \n* shoulder and scapular muscles strength is better \n* pincher grip of thumb to index finger increase \n\nTreatment Goal :\n \n* enhance overall grip \n* improve ulnar grip \n* strengthen shoulder and scapular muscles\n\nActivities: \n\n* hand wrap - sh external rotation elbow pronation  IR\n* glide - Ant - infe \n* stretching - sh , elbow , wrist \n* weight with sh flexion, side lying abduction , horizontal elbow flexion , extension , lateral rotation \n* Scapular muscle strengthening-Y.t exs , punching exercises in supine \n* cubital fossa massage & machine gun \n* ES - group elbow- flex, ext \n* point electrodes lumbricals - 45cont \n* weight bearing on affected limb- forearm support\n* sand , rice activity for grip \n* boll throwing activity with both hand \n* clips activity on swing', 40, 1),
(136, 'Physiotherapy Protocol-May', 'Treatment goals: \n* pain reduction \n* improve muscle strength \n* maintain flexibility \n\nExercise: \n* Us both elbow \n* Ift both elbow \n* wrist flexors stretch-3 rep 10 sec hold \n* wrist extensors stretch 3 rep 10 sec hold', 162, 1),
(137, 'Physiotherapy Protocol May', 'Treatment goals:\n* Reduction in pain\n* ⁠core muscle strength \n* ⁠pelvic floor muscle strength \n\nExercises :\n\n* Ankle movement \n* static abdominals \n* Bridging \n* static adductors , abductors \n* pelvic rotation \n* Active hip flexion , abduction \n* kegel exercise \n* Us - l4-l5 region 5 min\n* Ift - back area 10 min', 166, 1),
(138, 'OT protocol', 'Kshitij\n\nActivities(ever activity should be with done while weighted  jacket on) if possible,tie ankle weights.\nSlow treadmill walk.\nWrapped him in weighted blanket and do compression on it.\nPlay with clay.\nOpening and closing of nuts or bolts.', 48, 1),
(139, 'PT protocol', 'Arohi\n\nImprovements:quad strength has improved \nTone  is  reduced in both upper limb as well as lower limb.\n\n\n\nActivities:trunk rotation witg rings\nSide sitting reach outs with rings\nCurl ups\nSuperman pose on ballster with rings\nHand weight bearing\npush ups\nSit to stand\nBall or ballster supported standing \nStanding with knee 5-10 degree flexed\nQuad strengthening on chair (stepping up and down\nTreadmill walking \nknee extension in high sitting \nStretching: adductors\n\n\nAlternate day\n\nActivities:trunk rotation with the help of rings\nSide sitting reach outs with rings\nCurl ups.\nStanding with knee 5-10 degree flexed\nQuad strengthening on chair (stepping up and down)\nSide walking outside\nHand weight bearing\nPush ups\nStretching: adductors', 23, 1),
(140, 'OT Plan', 'Sharv\nImprovements: flapping of hands has been reduced\n\nHanging\nPrine on elbow on swing\nPro wraps from hand elbow to trunk\nHand walking with any tactile prop\nPlay with clay\nHanging', 143, 1),
(141, 'OT Protocol', 'Vihana\nImprovements:eye contact ,attention,dual tasking\n\nActivities:\nJumping from higher surfaces\nTeach normal (day to day) phrases\nDual tasking activities \nHand weight bearing\nBuild vocabulary for better speech\nAnd communication', 29, 1),
(142, 'pt plan', 'teach facial expressions ,IG stimulation to all facial muscles 90 reps,20 SF to the trunk, massage and taping to face (rt side)', 72, 1),
(143, 'parent meeting', 'improve communication, timings not able to understanding, long communication, after number, 3 and 7 number, knows small letters , ball catch throw, front and back, day night, today tomorrow,', 38, 1),
(144, 'Special education (may)', '*Socialization:-Mix with other people\n*Communication:-Daily talk about her/common colours/common shapes/common vegetables and fruits/parts of body \n*Cognition:-4peace puzzle/Matching shadow/Matching objects etc.\n*Academic:-Aa to Zz (oral)\n                     1 to 10(oral)\nScribbling and Coloring', 172, 1),
(145, 'occupational Therapy Protocol-May', 'Treatment goals :\n* improve sitting tolerance \n* enhance attention on task \n* work on grip \n\nActivities \n* Pencil rolling activity \n* hurdle walk with one tray \n* tactile activity on sitting- clay , identification of shape in pillow cover, \n* water activity - coins removed with spoon or boll \n* barrel walk with clips task \n* balance on blue sensory boll and ring activity', 151, 1),
(146, 'occupational Therapy Protocol-May', 'Treatment goal \n* work on eye contact \n* Reduce hyperactivity \n* work on body awareness , motor planning activity \n* Attention on task \n\nActivities:\n\n* Give less command and make him calm while activities \n* wrap on tummy and ankle bumper \n* slop walk on sensory mats with boll collect \n* barrel tunnel walk / pencil rolling \n* vestibular activity on wobble board- puzzle boll \n* upper limb prop activity- hand weight one tray \n* squat on sensory mat with any activity', 167, 1),
(147, 'Special education (June)', 'Socialization:-*Mix with other kids/people \n*Give and take Toys & Material (sharing with others)\n\nCommunication:-*Story telling by flash cards\n*Daily talk about her day/schedule/school/event \n\nCognition:- * 9-15 peace puzzle \n                    * Cube puzzle \n                    *Join the dots and make objects and colour it. \n*Months/Week name/Shapes/Colours/Fruits/vegetables/golden words/her self/her address/sense organs/Golden words\n                     \nAcademic:- (Oral part)*Letter identification (capital letters)\n* Number identification (1-50)\n(Written part)*Aa to Zz\n                        *1 to 50\n                       *Count and write (1-20)\n*Learning slogan of Jhansi ki rani Laxmi bai(I am the queen of Jhansi)', 38, 1),
(161, 'occupational Therapy Protocol-June', 'Improvements: \n* improve eye contact and  taking interest in activity \n* his taking weight on his hand \n* trunk control improve \n* improve postural awareness \n*  Hand  function improved \n* better trunk extensors \n\nTreatment goals: \n* combine Ot and pt protocol for better improvement \n* Enhance weight bearing capacity on limbs through activities \n* work on given take objects \n* work on sitting tolerance \n* independent standing and walking \n\nActivities:\n\n* wrapping fig 8 at shoulder \n* Removing rings from horizontal stick \n* Removing clips on clothes \n* water play , bekar tracing \n* Cross-legged sitting with wooden square pyramid\n* Side sitting with hand weight with Dominos given take with mother \n* Krishna position with one any activity \n* Kneel standing -try actively kneel sitting to stand a with help of ladder or one activity \n* lie down on prone with bolster at arm level for trunk extensor \n* weight shifting activity on lower limb\n* passive movement of upper and lower limb with stretch', 69, 1);
INSERT INTO `notes_master` (`note_id`, `title`, `description`, `patient_id`, `clinic_id`) VALUES
(151, 'Special education (June)', '*Socialization:-Mix with other people\n*Communication:-Daily talk about her/common colours/common shapes/common vegetables and fruits/parts of body \n*Cognition:-4peace puzzle/Matching shadow/Matching objects etc.\n*Academic:-Aa to Zz (oral and written)\n                      \n                     1 to 30(oral and written)\n                     अ आ (Hindi and Gujrati\n*Coloring', 172, 1),
(152, 'Special education (June)', 'Communication:-*Basic talks like about his self/school/home address/common colours,fruits, shapes,parts of the body /Week name/Months name/sense organs/Golden words/vowels\n\n\nSocialization:-*Mix with other kids /people \n\nCognition:-*10 to 15 peace puzzle \n                     *Dot matching and make objects \n                       *pattern/colour/drawing/object matching \n\nAcademic:-*Identification (1 to 20)/Aa to Zz \n                \n* Making letter Aa to Hh and number 1&2\n*Learning slogan of Bhagat Singh(Inkalab Jindabad)', 26, 1),
(155, 'occupational Therapy Protocol-June', 'Improvements:\n* improve sitting ability \n* enhance attention in task \n\nTreatment goals:\n* Add more hand prop activities \n* Avoid distractions during task \n* Switch activity after finishing one \n* increased sitting ability with task \n\nActivities: \n* Hand wrap\n* Hand walk with one tray , treadmill walk or commando crawling \n* Balance on blue sensory boll with wooden square \n* one tactic activity like playing with form , making shapes with clay , water activity removing pom-pom bolls , coins or squeezing \n* scribble', 151, 1),
(156, 'occupational Therapy Protocol-June', 'improvements :\n* improve tripod grip , precision grip \n\nTreatment goals:\n* work on toe walking \n* work on front back concept\n* upper and lower limb strength\n* work on day time concept \n\nActivities:\n* 5 min eyes close with hand fold \n* calf and hamstring muscles stretch \n* tandom walking on balance beam with boll on hand\n* deep squat \n* heel walk with one tray \n* clips on T-shirt front and back and place it on swing \n* Hand weight bearing activity \n* push up \n* boll throwing on chair', 38, 1),
(157, 'Physiotherapy Protocol June', 'Improvements: \n* Better standing balance\n \nTreatment Goals: \n* Improve degress of freedom\n* Improve endurance\n\nActivities-\n* Stretching of elbow flexors, hip flexors, hams and TA, trunk rotational stretch\n* supine on red ball, with upper limb reachouts\n* side lying on ball with reachouts for side opening of rib cage.\n* spine extension facilitation\n* half kneel rotational reachouts with one hand weight bearing.\n* tredmill back ,side and front walk\n* Add fine motor clips, beads, theraputy', 14, 1),
(158, 'occupational Therapy Protocol-June', 'Improvements: \n* Improve Command following \n* less zone out during task \n* less hand unnecessary action \n* improve lower limb weight bearing \n\nTreatment goals:\n* Add texture with activities \n* work on core muscle activation \n* lower limb strength \n* work on attitude of walking \n\nActivities: \n* Crawling with one tray help of tunnel or barrel \n* hurdle walk with different heights \n* hand  weight bearing with tray \n* hand walk on treadmill \n* sitting on sensory boll and posterior lateral reach out with one activity \n* squat on balance beam and finding objects underneath \n* one tactile activity', 19, 1),
(159, 'occupational Therapy Protocol-June', 'Treatment goals:\n* Make him engage and alert during session \n* Don’t let him zone out \n\nActivities: \n* prop on upper limb activity like hand walk on treadmill or tray \n* water play -  like coins transfer with spoon or pompon squeeze one tray or coins \n* swing activity \n* climbing in barrel taking bolls and putting in basket', 27, 1),
(160, 'special education (June)', 'Socialization:-*Mix with other kids / people \n                         *Competitive games/Educational games \n\nCommunication:-*Say hi/hello/bye & common talk with other kids/people \n*Talk about her daily routine/about her self/school/home/events,king of fruits, vegetables, animals, water animals, birds, National symbols (Flag, Song, Anthem,dress, sweet, fruit, currency, vegetable, animal, bird,wateranimal,flower, tree,emblem)/About senses organs &internal organs/About traffic lights and their work/golden words \n\nCognition:-*Puzzle 12 to 30 peace\n                *Object matching \n                  *Letters/Numbers matching \n                 * activity for concentration (colouring /drawing)\n\n\nAcademic:- *CVC words in English \n          *Working on small sentences\n*Concept of this/that/these/those &\nis,am,are\n*Revision of article (a & an)\n                     *In Maths numbers (1 to 100 )/missing numbers/after and before numbers \n\n*Number names (1 to 10)\n  *Spelling of week names                   \n*preparing for the play role of Kasturba Gandhi', 43, 1),
(162, 'occupational Therapy Protocol-June', 'Treatment goals: \n* work on eye contact \n* given take objects \n* visual exploration \n* improve degree of freedom on walking \n* work on independent standing and walking \n\nActivities:\n* bekar tracing \n* given take objects with mom\n* Step standing on green stool\n* with posterolateral reachouts\n* step up and down on chair\n* standing holding onto red wand (placed on stool)\n* standing holding on to red wand,pertube on all directions, for balance and recruitment of muscles.\n* hand weight bearing and rotational reachouts unilateraly.\n* Walking with chair ( frequent change of directions)\n* boll activity-Standing ( for quds recruitment ) \n* stretching - tc , hamstrings, quads \n* Step standing on green stool with posterolateral reachouts \n*  trunk extensors stretch on boll', 50, 1),
(163, 'occupational Therapy Protocol-June', 'improvements:\n* improve sitting ability \n* better eye contact \n\nTreatment goals: \n* work on given take \n* command following \n* work on core muscles \n* teach colour concept , sustained eye contact \n\nActivities: \n* treadmill walk and hand walk \n* hurdle walk \n* tunnel activity with abcd \n* hand weight bearing activity \n* supine to sit on ball  with one tray \n* lycra swing with activity', 148, 1),
