(172, 'PT Protocol July 2025', 'Treatment goals: \n* work on degree of joint mobility \n* work on fine motor \n* work on balance and postural alignment \n\nActivities: \n\n* Stretching of elbow flexors, hip flexors, hams and TA, trunk rotational stretch\n* supine on red ball, with upper limb reachouts\n* side lying on ball with reachouts for side opening of rib cage.\n* spine extension facilitation\n* Hand weight with rotational reach-outs \n* step standing with post - lateral reach - outs \n* tredmill back ,side and front walk\n* fine motor activity clips, beads, or peg board , theraputti.', 14, 1),
(173, 'OT Protocol July 2025', 'Treatment goals: \n* Improve eye contact \n* improve sitting Tolerance \n* Work on command following \n* Enhance attention in task \n\nActivities: \n* walking on sensory mat with tray \n* give texture activity with sitting ( Water , Rice , sand )\n* Give and take activity , wooden square or ring \n* One light box activity', 179, 1),
(174, 'PT Protocol July 2025', 'Improvements: \n* Weight bearing on upper limb improved \n* His taking weight on lower limb \n* Better trunk control\n\nTreatment goals: \n* work on lower limb weight shifting and   improve weight bearing capacity \n* work on independent standing and walking \n\nActivities: \n* kneel sitting position hold with sit to stand \n* step kneel position hold \n* Standing with ladder support with marching \n* trunk flexion to extension in standing to facilitate trunk extensor \n* step kneel to standing transition \n* treadmill walking with support', 69, 1),
(175, 'PT Protocol July 2025', 'improvements: \n* improve weight bearing on lower limbs \n* improve posture awareness \n\nTreatment goal : \n* increase weight bearing on left side \n* improved gait pattern \n* work on lower limb mobility \n* improve lower extremity coordination and control\n\nActivities:\n* sit to stand on bolster with stick holding  10 rep 3 times \n* weight shifting in lungs and side lunges 3 rep 10 sec hold \n* step standing on stool or bolster hold \n* Half kneel with post lateral reachouts \n* hip abduction bilateral \n* quadratus lumborum ,hip flexor stretch \n* 90-90 boll hold or crutches for abdominals \n* bridging boll press', 37, 1),
(176, 'OT Protocol July 2025', 'Improvements: \n* he is alert during session \n* less zone out \n* talking interest and expressing desire like what he wants to take \n\nTreatment goals: \n* work on less command and let him finish task with single command \n* Aware him to activity and task \n* work on sustained eye contact \n\nActivities: \n* introduce different height with one task \n* hand walking on treadmill or weight bearing with tray \n* water play -  like coins transfer with spoon or pompon squeeze \n*  dark room activity like , light box', 27, 1),
