(199, 'august OT plan Dhanvi', '*Dhanvi* \n• _Goals_ \n_ to improve tone \n_ to improve range of motion \n_ reduce dystonic componet \n_ improve in head control and trunk Control \n_ improve eye hand coordination \n\n• _Activities_\n_ passive  range of motion of upper limb  fingers , wrist , elbow ,and shoulder all movements flexion and extension, abduction and adduction, external rotation and internal rotation supination pronation \n_ streching of upper limb \n_ joint approximation \n_ beacker tracking \n_ hand weight bearing \n_ remove clips from clothes \n_ object give and take like flowers, peg board etc. from mid line to side  \n_ drop the rings \n_oromotor  massage', 175, 1),
