(201, 'shivansh august plan', '*Shivansh*\n • _Goals_\n_ to  improve command following \n_ improve in sitting tolerance \n_ reduce hyperactivity \n_ improve eye hand coordination \n_ improve in holding object simultaneously\n_ improve endurance \n_ postural control \n _ improve gripping \n_ improve in independent climbing on different height \n\n• _Activities_\n_ colouring  or scribbling \n_ treadmill walk - hand walk , front walk ,back walk, side walk on both side \n_ jumping on trampoline 50 count then do some activity like put rings again 50 times jump .\n_ hurdle walk with different height stool and object holding of different colours or shapes in both hand/ hurdle walk like climbing up stairs and put some like that \n_ hand weight bearing activity with tray or square \n_ supine to sit on ball \n_ water activitie like squeeze the spong .\n_ talk with me like your name is shivansh , in which school ur are , do imitation- like clap and hi five, roll and roll, clap, raise ur hand etc', 171, 1),
(202, 'Naksh august plan', '*Naksh* \n• _Improvement :_ \n _Better elbow extension _keeping hand straight \n_Better foot placement \n_Opening of all fingers \n_Better thumb abduction and adduction \n_ better in opening and closing of fingers \n_ better in thumb flexion extension \n\n• _Goal_ : \n_Improve thumb movement  \n_Improve on leg that keep the full leg down while walking \n_improve in elbow extension \n_improve in gripping activity \n_ improve in plantar flexion and dorsiflexion \n_ improve in squating postion \n\n •_Activities:_ \n_Treadmill walk each side  front,back , both side and hand walking \n_Fine motor activities \n_Stepping up and throwing the ball with elbow extension or complete the tray \n_Lunges on wedge \n_ Squats   and take the object from down and keep it up like peg board or square or puzzle ball .\n_Ig and sf for ankle dorsiflexion and thumb abduction \n_Stretching of upper limb- fingers strech , supination pronation and lower limb - hamstring, calf, flexors muscles \n_ supine to sit on ball tacking object from down and giving up while sitting .\n_ hurdles Walk with different height stools \n_ hand weight activity \nPushing the ball with both hands\n_ hand weight bearing with square or shape shotar \n_ actively doing toe touch .', 5, 1),
