(216, 'Special education (September)', 'Communication:- Basic talks like about his self, Identify colours and shapes \n\nCognition:Identify and tell the letters with object,Identify and tell the numbers (1-20),4 peace puzzle \n\nSocialization:- Play with others\n\nAcademic:-*Scribbling and Coloring\n                      *Join dot to dot \n                       *working on hand and eye coordination', 22, 1),
(217, 'Special education (September)', 'Communication:-Basic talks like about his self /school/home/colour/Shapes etc\n*Socialization:-Working on socialization like talk with other kids/do activities with others \n*Cognition:-Logical worksheets/puzzles/ coloring and Working on attention \n*Academic:- Working on Phonics/अ से अः/one dijit addition', 206, 1),
(218, 'Special education (September)', 'Socialization:-*Mix with other kids / people \n                         *Competitive games/Educational games \n\nCommunication:-*Say hi/hello/bye & common talk with other kids/people \n*Talk about her daily routine/about her self/school/home/events,king of fruits, vegetables, animals, water animals, birds, National symbols (Flag, Song, Anthem,dress, sweet, fruit, currency, vegetable, animal, bird,wateranimal,flower, tree,emblem)/About senses organs &internal organs/About traffic lights and their work/golden words\n\nCognition:-*Puzzle 12 to 30 peace\n                *Object matching \n                  *Letters/Numbers matching \n                 * activity for concentration (colouring /drawing)\n\n\nAcademic:- *CVC words in English \n          *Working on small sentences\n*Concept of this/that/these/those &\nis,am,are\n*Revision of article (a & an)\n*family words (ai and oa)\n*Working on CVVC words \n                     *In Maths numbers (1 to 100 )/missing numbers/after and before numbers \n*one dijit addition \n*Number names (1 to 100)\n*अ से अः *स्वर\n(Oral and written )\n  *Spelling of week names', 43, 1),
(219, 'Special education (September)', 'Working on sitting tolerance and Cognition', 189, 1),
(220, 'September 2k25', 'Goals :- improve brain engaging, to stop her unnecessary wanting of hair tying ,oral , improve command following, \nTreatment activities:\nCopy shapes(straw and binder) \nTo remove beads from putty\nTo do complex puzzle solving \nBeading with standing on wobble board \nHurdle activities using different object tray \nJumping and removing clips from rope with hurdle \nShape a thorn \nShadow matching \nOral massage oral vibrator hickey \nHand weight bearing activities while on  swing\nLadder and rope \nClothes wearing and removing \nHelp in adl activities \n\n\nImprovement:\nImprovement in command following \nImprovement in solving complex puzzle solving \nImprovement in completing complex task', 28, 1),
(221, 'September 2k25', 'Goal: To Increase brain engaging activities , Improve interest in doing tasks with hurdles, to include griping activities, increase awareness to touch response  and  body awareness, reduce hyperactivity, \nTreatment activities:  oral massage with his own lotion \nOral Vibrator \nDark room with colouring lights \nActivities with using different textures\nBall collection \nBarrel ball collection \nHand print \nBall shape puzzle \nHand weight bearing \nSwing standing clip collection \nChange hurdle of different height \nUse some tactile things while sitting foam water \nSwing for vestibular \nImprovement: \nImproved sitting tolerance \nLess irritated and show interest in doing tasks\nImproved response to touch', 20, 1),
(222, '2k25 September', 'goal : to reduce hyperactivity, reduce flapping of hands, use more prop \nActivities: \nBlanket wrap with spike ball press over whole body for compression \nLight music \nSwing \nAdd tactile \nHand weight bearing in treadmill with peg board \nPutty search for beads use blue one hard \nWeight jacket \nNeo wraps on both the hands', 143, 1),
(223, 'PT Protocol Sep 2025', 'Treatment goals:\n* work on neck control \n* improve postural stability and improve weight bearing strength \nActivities:\n* passive movement of upper and lower limb every joints\n* machine gun vibration on chest place hand on chest and apply vibration through hand \n* vishnu position hold\n* side sitting position hold\n* cross sitting position hold\n* Hand weight bearing on sitting', 234, 1),
(224, 'OT sep 2025', 'Improvements:\n* command following improved\n* she go  to play and talk other children .\nTreatment goals: \n* Work on shoulder and hip mobility \n* work on age appropriate gross motor skills \nActivities:\n* Treadmill - front,back , side \n* Climbing on ladder and remove clips \n* scooters board activity to collecting boll\n* scribbling 10 min\n* prone on boll to facilitate trunk extension and boll throwing \n* Hand weight on wobble activity \n* overhead boll throwing \n* any on tactile activity', 179, 1),
(225, 'PT sep 2025', 'Treatment goals:\n* work on lower limb weight shifting and   improve weight bearing capacity \n* work on independent standing and walking \n* work on positional transition and improve postural control \n\nActivities: \n* wrap for glutes recruit \n* kneel sitting to stand \n* step kneel position to stand \n* Standing with ladder support \n* trunk flexion to extension in standing to facilitate trunk extensor \n* walking with support \n* sitting to standing \n* Stretching lower limb\n* Step up and down', 69, 1),
(226, 'ot September 2k25', 'Goal - , Improve brain engaging, improve response to auditory command, ,to improve concentration and to improve eye contact while talking, improve focus and concentration\nTreatment activities:\n>Flashcards \nTray cards \n>Continuous brain engaging activities \nRope clips jump and pick, figure of 8 rolling \nBeads with unstable surface, treadmil front walk back walk jumping with ball catch object removing from clay putty medium green blue roller with hanging \nOlfactory \nDesensitization \nChairs ke niche se sleep walk with tray \nCones with pom pom \nSomething from one chair to another with swing \nHand weight bearing on swing \nUse more prop \nBarrel roll while standing clips \nImprovement:-\nResponding more to auditory command\nLittle progression in making eye contact \nLess zoning out \nImproved identification\nCan do complex activities \nSeptember goal: \nCrayoning \nSwinging with standing and sitting (use some tray clips) \nMake him do straight line sleeping line \nBrain gym activities \nPut beads on infinity loops \nFocus more on activities which requires focus concentration like rope walking so that he focuses  downward \nCycling practice \nBeads and thread with either ends on the chair and move one bead from one direction to other', 22, 1),
(227, 'OT September 2k25', 'Focus on crawling adductor stretching hand weight bearing reachouts in quadruped \nGoal :-To work on complex transitions, improve multitasking activities, improve reaction time, improve cognitive problem solving, to maintain adductor flexibility, add crawling timing, focus on hand gripping\nTreatment :\nfigure of 8 rolling \nBeads with unstable surface,  object removing from clay putty medium green blue \nBarrel crawling/rolling with tray \nFocus on gripping\nHand strengthening\nSomething from one chair to another with swing \nHand weight bearing on swing \nUse more prop \nHurdles including chairs cones use more heightened hurdles to remove fear of height also use more unstable surface to increase balance coordination\nUse of pom pom with tongs will increase intrinsic activity of hands with hurdles\nImprovement :\nImprove eye contact while talking \nCan easily sit in cross sitting position \nReduced repetition of words \nOn point Answers to any questions', 183, 1),
(228, 'OT September 2k25', 'Treatment goals: \nmake him Happy and actively engage him in activity . focus on command following, make him do more physical work to actively engage him doing various activities \n\n-Activities\nTry Frequent change of task and Activities \nAdd water play , water colour play. Try patient guided session,\nIncrease the level of puzzles, to improve complex problem solving\nHurdles with what and where question make him say max words \nAdd ladder activities if he is cooperative\nAdd hand weight bearing activities \nAdd rope pulling \nBall flexion \nKnowledge puzzle \nKneel walking on mattress and make him do a task \nImprovement :-\nShows interest in doing tasks \nLess zone out and tries to communicate \nFollows command', 27, 1),
(229, 'OT Sep 2025', 'Improvements: \n* Hyperactiveness is reduced. she is followed instructions and attention on task is poor \n\nTreatment goals: \n* work on postural alignment.\n* work on eye hand coordination and fine motor .\n* work on her running behaviour during session \n\nActivities: \n* with discipline finish two task in sitting without and distractions and withdrawal \n* secribbling 10 min\n* copy the shape \n* hand weight activity \n*  pomp pom boll  hold with clips and put in basket . \n* storw binder activity On wobble board \n* climbing ladder and removing clips and put on rope ladder \n* jump on circle ( write numbers) and do shadow matching', 189, 1),
(230, 'PT sep 2025', 'Improvements: \n* upper and lower limb strength is improved.\n\nTreatment goals: \n* Work on overall strength \n* work on endurance and balance .\n* work on gait pattern \n\nActivities:\n* wall boll squats \n* hand walk on shooter activity\n* weight cuff with treadmill walk in front side \n* gym boll transfer through leg to hand and reverse \n* glute bridge on gym boll \n* sensory circuit standing boll catching\n* beam balance walking with one task \n* stretching tight muscles', 92, 1),
(235, 'OT sep 2025', 'Improvements: \n* she is actively participating in task and completing with attention.\nTreatment goals: \n* work on body middle cross skills \n* work on fine motor skills \nActivities:\n* Rope pulling with \n* climbing on pigg nose and removing boll and solu the puzzle \n* boll-or pom-poms collecting through ice cream stick and putting cone \n* domino sorting -  take any two colour put in same colour of cone use both hand to put in with straight and cross manner\n* plank on hand on circle and putting boll on glass \n* hold sensory half moon boll in against wall in kneel position and transfer the things\n* ⁠cross the rope and transfer the clips or rings', 19, 1),
(232, 'parents coments', 'manipulation, mirror images in small alphabet', 151, 1),
(233, 'Ot sep 2025', 'Improvements:\n* Eye contact and sitting ability improved but stil he resist \nTreatment goals:\n* Work on eye contact and attention on task \n* teach colour \nActivities:\n* boll throwing and catching play \n* treadmill front and back \n* beans put in teddy bear mouth activity  on sitting\n* blue and red boll sorting with two hurdle cross and place in separate basket \n* make tower with straw and binder', 196, 1),
(234, 'Pt sep 2025', 'Treatment goals :\n* work on independent sitting and standing \nActivities: \n* stretching of feet for clubfoot \n* Quadruped position on bolster \n* vishnu position hold \n* sit to stand on bolster \n* half kneel to standing \n* side sitting with hand weight bearing \n* step standing on bolster', 186, 1),
(236, 'OT September 2025', 'Treatment goals:\n\n1) work on eye contact\n\n2) work on sitting ability\n\n3) colour concept\n\nActivities:\n\n* treadmill\n\n* colour sorting\n\n* one hurdle cross with shape shorter, clips \n\n* beaker tracing \n\n* one swing activity- rings or wooden square\n\n* jump and stop on trampoline', 199, 1),
(237, 'Arohi OT plan for September', 'Arohi upper limb ot*\n\n_Goal_\n\n_improve hand movements\n\n_To Improve in gripping activity\n\n_opening and closing of fingers\n\n_ improve in supination and pronation\n\nelbow flexion and extension\n\n_Activities_\n\n_streching of upper limb all stretch finger flexion, wrist flexion, elbow flexion and extension, internal rotation and external rotation.\n\nsupination and pronation with coins active\n\n_elbow flexion and extension with coins or puzzle ball activity\n\n_abduction and adduction with putti pulling or shape shotar or coins puzzle ball rings etc\n\n(everything on standar in standing)', 23, 1);
