(238, 'Pt sep 2025', 'Improvements \n* Right side shoulder abduction and flexion range is good \nTreatment goals : \n* work on posture alignment \n* improve strength on upper and lower limb on Rt side \nActivities: \n* Wrap to correct postural scoliosis \n* treadmill - front, back , side walk \n* plank position with one activity \n* scapular muscle activation exs \n* step up on right leg with boll hold on hand do  shoulder flexion \n* Squat with shoulder abduction with transfer the things or ring activity \n* Half kneel to kneel position \n* supine and pronation on elbow \n* hand stretching \n* Hand boll rolling exercise to facilitate wrist movement \n* towel squeeze exs with hand \n* Ql stretch', 13, 1),
(239, 'OT sep 2025', 'Treatment goals: \n* work on arm and hand  functions \n* oral motor regulation \n* colour concept \nActivities: \n* left sh  forward , side reachouts with putty or peg board \n* give take peg board activity \n* hand  and shoulder passive movement with stretch \n* speech kit box \n* sorting activity- shape shorter \n* teach blue and red colour with reach out activities', 191, 1),
(240, 'OT Plan for September 2025', 'Improvements Noted:\n\n1)Better sitting tolerance\n2)Improved command following\n\nCurrent Concerns:\n1)Stubborn behavior during tasks\n2)Fixation on doing work in a fixed sequence (especially alphabets)\n3)Gets cranky if sequence is altered\n\nGoals:\n1) Reduce rigidity and task fixation\n2) Improve flexibility in task approach\n3) Enhance frustration tolerance\n4) Encourage problem-solving in varied situations\n5) Improve environmental awareness and socialization\n\nActivities:\n1) Graded Sequence Modification Tasks → gradually introduce small changes (skip a letter, mix two letters) with positive reinforcement.\n\n2) Use puzzles and sorting tasks with varied patterns (not always sequential).\n\n2) Sensory & Play Activities\n\n3) Tyre swing with ball basket (continue).\n\n4) Shape sorter with rod (random order, therapist decides sequence).\n\n5) Tunnel travel (introduce choice-making: which side to exit).\n\n6) Heavy Work & Prop Tasks\n\n7) Tactile & Fine Motor Play\n\n8) Lotion/theraputty activities with task changes mid-way.\n\n9) Removing stickers from body in random order.\n\n10) Vibrator/pro-wraps for sensory tolerance.', 147, 1),
(247, 'Special education (October)', '[Working on]\n *sitting tolerance and Cognition \n*Learning A to Z and colours', 189, 1),
(248, 'Special education (October)', 'Improvement is visible:- some sitting tolerance, Identify basic colors and shapes, can recognize \nA to Z and number 1 to 10\n          [Working on]\nCommunication:- Basic talks like about his self, Identify  fruits and vegetables \n\nCognition:Identify and tell the letters with object,Identify and tell the numbers (1-20),4 peace puzzle \n\nSocialization:- Play with others\n\nAcademic:-*Scribbling and Coloring\n                      *Join dot to dot \n                       *working on hand and eye coordination', 22, 1),
(244, 'Special education (October)', 'Improvement is taking place:-Now she mixes easily with children/she can make 9 peace puzzle/can recognize letters by phonic sound/knows 1 to 10 Number names/can talk about her self and common things \nSocialization:-* Working on Mix with other people \n\n[Working on]\nCommunication:-*Story telling by flash cards\n*Daily talk about her day/schedule/school/event \n\nCognition:- * 15 peace puzzle \n                    * Cube puzzle \n                    *Logical worksheets \n*Months/Week name/Shapes/Colours/Fruits/vegetables/golden words/her self/her address/sense organs/Golden words/National flag-Tiranga &colour also /about traffic lights and their work /National fruit and National vegetable\n                     \nAcademic:- *Daily Revision part\n* Working on 2 an 3 letter words \n* Number identification (1-100)\n(Written part)*Aa to Zz and 2 letter words \n                        *1 to 100\n                       *Count and write (1-50)\n*Number names (1 - 12)\n*one dijit addition \n*Before numbers/between Numbers and after numbers \n*Week name\'s spelling \n*अ से अः (oral and written)\n\n*Introduction of  क से ङ\n*Start learning about animals', 38, 1),
(246, 'Special education (October)', 'Improvement is visible:- \n talks like about his self/school/home address/common colours,fruits, shapes,parts of the body /Week name/Months name/sense organs/Golden words/vowels/National flag-Tiranga and colour also/about traffic lights and their work /National fruit and National vegetable\n\n                 [ Working on]\nSocialization:-*Mix with other kids /people \n\nCognition:-*10 to 15 peace puzzle \n                     *Dot matching and make objects \n                       *pattern/colour/drawing/object matching \n\nAcademic:-*Identification (1 to 30)/Aa to Zz \n                \n* Making letter Aa to Zz and number 1 to 25\n*Number names (one to five)\n\n*Hindi vowels(oral and written)\n*after and between Numbers', 26, 1),
