(251, 'Special education (October)', 'Improvement is visible:-\n* with other kids / people \n                         *Competitive games/Educational games \n\nCommunication:-*Say hi/hello/bye & , animal, bird,wateranimal,flower, tree,emblem)/About senses organs &internal organs/About traffic lights and their work/golden words\n\nCognition:-*Puzzle 12 to 30 peace\n                *Object matching \n                  *Letters/Numbers matching \n                 * activity for concentration (colouring /drawing)\n\nWorking on:-\n*start learning about animals \n *CVC words in English \n          *Working on small sentences\n*Concept of this/that/these/those &\nis,am,are\n*Revision of article (a & an)\n*family words (ai,ay,a-e,oe,oo,ee)\n*Working on CVVC words \n                     *In Maths numbers (1 to 100 )/missing numbers/after and before numbers \n*Two dijit addition \n*Number names (1 to 100)\n*अ से अः *स्वर and क से ङ\n(Oral and written )\n  *Spelling of week names                   \n*Table of 2', 43, 1),
(252, 'parent councelling', 'crying, language use, body posture, when asked meaning less talk, volume modifications, cloth related issues, stubborn behavioral, hitting,', 36, 1),
(253, 'PT Oct 2025', 'Improvements \n* postural scoliosis is corrected compared to previous \nTreatment goals : \n* work on posture alignment \n* improve strength on upper and lower limb on Rt side \nActivities: \n* Wrap to correct postural scoliosis \n* treadmill - front, back , side walk \n* plank position with one activity \n* scapular muscle activation exs \n* step up on right leg with boll hold on hand do  shoulder flexion \n* Squat with shoulder abduction with transfer the things or ring activity \n* Half kneel to kneel position \n* supine and pronation on elbow \n* hand stretching \n* Hand boll rolling exercise to facilitate wrist movement \n* towel squeeze exs with hand and feet also \n* Ql stretch', 13, 1),
(254, 'PT Oct 2025', 'Treatment goals :\n* work on independent sitting and standing \nActivities: \n* Wrapping fig of 8 \n* stretching of feet for clubfoot \n* Quadruped position on bolster \n* vishnu position hold \n* sit to stand on bolster \n* half kneel to standing \n* side sitting with hand weight bearing if he cooperate then add sorting and putting things side \n* step standing on bolster \n* (any three day of week)Standing on standing bar and midline reachouts', 186, 1),
(256, 'PT Oct 2025', 'Treatment goals:\n* work on neck control \n* improve postural stability and improve weight bearing strength \nActivities:\n* fig of 8 pro wrap \n* wrap roll around neck \n* passive movement of upper and lower limb every joints\n* machine gun vibration on chest place hand on chest and apply vibration through hand \n* vishnu position hold\n* side sitting position hold\n* cross sitting position hold\n* Hand weight bearing on sitting \n* standing bar activity on 3 days week', 234, 1),
(257, 'PT Oct 2025', 'Improvements: \n* his strength is improved \nTreatment goals: \n* work on endurance and balance .\n* work on gait pattern \n* time bound activities for his slow response on task specially in fine motor task \nActivities:\n* wall boll squats \n* weight cuff with treadmill walk in front side \n* gym boll transfer through leg to hand and reverse \n* glute bridge on gym boll \n* sensory circuit standing boll catching\n* beam balance walking with one task \n* boll sorting with spoon hold and arrange it with spoon \n* collecting pom pom boll or arranging rubber on boll in short time', 92, 1),
(258, 'Pt Oct 2025', 'Treatment goals: \n* work on neck control \n* independent rolling and \n\nActivities:\n* Passive movement of Ul and LL\n* facilitate Rolling - on mat and wedge in antigravity direction \n* wrap neck towel to prevent extension thrust \n* wrapping fig 8 for trunk control \n* side sitting hold \n* cross sitting hold \n* vishnu position hold \n* butterfly position hold\n* forearm support \n* prone on boll for neck control and tracing objects', 170, 1),
(259, 'OT October 2025', 'Previous Month (September 2025) Goals Achieved:\n\nImprovement noted in eye contact during interactive and task-based sessions.\n\nColour sorting and shape identification skills have improved; can identify and match primary colours and basic shapes.\n\nDemonstrates better hurdle walking with balance and coordination.\n\nLearned the concept of “jump and stop” on the Swiss ball during sitting activities.                                       Current Month (October 2025) Goals:\n\nReduce hyperactivity (running here and there, impulsive movements) reduce hand streaming.\n\nIncrease sitting tolerance and improve ability to focus on table-top activities.\n\nEnhance sensory regulation and attention span through structured sensory input.              Treatment Plan / Activities:\n\nDeep Pressure Techniques:\n\nWrapping (using blanket or lycra sheet for calming input)\n\nBrushing protocol (Wilbarger method – as per child’s sensory response)\n\nJoint compression (10 reps per major joint, proximal to distal approach)\nWeighted or textured toys: Small stress balls, squishy toys, fidget cubes, or putty.\n\nResistance activities: Squeeze a ball, push against a wall (“push wall”), or pull therapy bands.\n\nHeavy work activities: Carrying weighted objects, pushing/pulling trolleys, or wiping a table.\nProprioceptive & Vestibular Activities:\n\nTreadmill walking – slow to moderate pace\n\nSwing activities (linear and rotary movement using rings or wooden square)     Jump and stop on trampoline with verbal cues (“jump–stop–listen”)\n\nObstacle course with crawling, pushing, and pulling components\n\nFine Motor & Cognitive Activities:\n\nBeaker tracing and shape matching\n\nColour sorting and peg board activities\n\nUse of visual schedule to improve sequence following and reduce distractibility', 199, 1),
(260, 'OT Plan for October 2025', 'Goals:\n1) Reduce rigidity and task fixation\n2) Improve flexibility in task approach\n3) Enhance frustration tolerance\n4) Encourage problem-solving in varied situations\n5) Improve environmental awareness and socialization\n\nActivities:\n1) Graded Sequence Modification Tasks → gradually introduce small changes (skip a letter, mix two letters) with positive reinforcement.\n\n2) Use puzzles and sorting tasks with varied patterns (not always sequential).\n\n2) Sensory & Play Activities\n\n3) Tyre swing with ball basket (continue).\n\n4) Shape sorter with rod (random order, therapist decides sequence).\n\n5) Tunnel travel (introduce choice-making: which side to exit).\n\n6) Heavy Work & Prop Tasks\n\n7) Tactile & Fine Motor Play\n\n8) Lotion/theraputty activities with task changes mid-way.\n\n9) Removing stickers from body in random order.\n\n10) Vibrator/pro-wraps for sensory tolerance.', 147, 1),
(261, 'OT plan for the month of October 2025', 'Monthly Goals\n\nIncrease sitting tolerance during structured table-top activities.\n\nReduce hyperactive and escape behaviours (e.g., running, irrelevant talk) through sensory regulation.\n\nImprove attention and task completion during therapist-directed or motor-based activities.\n\nTherapy Activities for This Month\n1. Sensory Regulation Activities\n\nBrushing and joint compression.\n\nDeep pressure or wrapping with weighted blanket or lycra sheet.\n\nHeavy work tasks:\n\nPushing/pulling weighted box or therapy ball.\n\nWall push-ups, animal walks (bear walk/crab walk).\n\n2. Attention & Sitting Activities\n\nVisual schedule (First → Then method: “First work, then swing”).\n\nShort, engaging table-top tasks:\n\nPegboard or shape sorting\n\nTracing, simple puzzle, or beading\n\nSorting coins, buttons, or colour tokens\n\n\n3. Controlled Movement Activities: To channel hyperactivity positively:\n\nSwing activity (linear, gentle) – 3–5 minutes for vestibular input.\n\nTrampoline “jump and stop” game – improves impulse control.\n\nObstacle course – crawl → jump → stop → carry item.\n\nTreadmill or rhythmic ball dribbling – to release excess energy.', 237, 1),
(262, 'upper limb plan for the month of October 2025', 'Goal_\n\n_improve hand movements\n\n_To Improve in gripping activity\n\n_opening and closing of fingers\n\nimprove in supination and pronation\n\nelbow flexion and extension\n\n_Activities_\n\n_streching of upper limb all stretch finger flexion, wrist flexion, elbow flexion and extension, internal rotation and external rotation.\n\nsupination and pronation with coins active\n\n_elbow flexion and extension with coins or puzzle ball activity. abduction and adduction with putti pulling or shape shotar or coins puzzle ball rings etc\n\n(everything on standar in standing)', 23, 1),
(263, 'OT plan for the month of October 2025', 'Goal\na) To improve memory and sequencing ability.\nb) To enhance recognition of colours and shapes.\nc) To develop planning, organization, and attention skills.\n\n\n\nActivities\na) Sequencing Activities\n\nArrange picture cards in correct story order (morning routine, eating process).\n\nCopying and recalling patterns made with beads or blocks.\n\nb) Colour & Shape Activities\nColour sorting (red objects together, blue objects together).\n\nShape puzzles and matching boards.\n\nColour–shape combination game (e.g., “find red circle, blue square”).\n\nc) Memory & Recall Games\n\n“Simon Says” with 2–4 steps.\n\nRepeating a short sequence of claps, taps, or steps.', 38, 1),
(264, 'OT Oct 2025', 'Improvements:\n* He follows commands and give eye contacts \n* his stubbornness is reduced compared to before \n\nTreatment goals :\n* pick one activity which he wants to do \n* he knows colour and shape sorting but doesn’t give appropriate answers \n* need to work on stubbornness and his withdrawal behaviour \n\nActivities: \n* sitting activity with his choice and if he doesn’t want to do let them sit for couple of time and make sure that he needs to finish this \n* 5 min trademil walk \n* Jump on disk with veg sorting \n* crawling inside the tunnel and do sorting \n* last 10-15 min session take place in the main therapy room \n* diff height obstacle cross circuit to get rid of his fear and maintain our previous result \n* texture play with rice  if he cooperates', 196, 1),
(265, 'OT Oct 2025', 'Improvements: \n* Hyperactiveness is reduced. she is followed instructions and attention during task is focused and improved .\n* Her running behaviour during session is reduced \nTreatment goals: \n* work on sway back posture \n* brain gym activities for quickness and to maintain focus and arousal   \nActivities: \n* with discipline finish two task in sitting without and distractions and withdrawal \n* secribbling 10 min\n* clay play \n* copy the shape \n* tracing fig 8 or arrange on that \n* Treadmill back walk \n* hand weight activity on wobble board \n*  pomp pom boll  hold with clips and put in basket on beam walk \n* jump on colour full disk and do roll and boll \n* supine to sit on boll \n* bilateral  hand activity tracing errors and sorting beads', 189, 1),
(266, 'OT Oct 2025', 'improvements:\n* She is following commands and now two way communication she is initiating\n* her hip and sh mobility improved .\n\nTreatment goals:\n* Make her to do share things \n* give goal oriented task where she needs to use her brain. \n* her name concept is not clear \nActivities :\n* talk with her and ask her family members names \n* treadmill walk- front, side, back \n* crayons for 10 min\n* action card play- do action With that \n* find out the things with gliding stool \n* 10 min and play with other therapist or kids \n* tactile play \n* Hit the boll on balloons or give landmarks according to colour \n* sit to supine on boll \n* boll slide on wall and do squatting\n* rolling into barrel and do roll a boll activity', 179, 1),
(267, 'OT Oct 2025', 'Improvements:\n* His shoulder movement is improved.even now he is able to open fingers and fits and reached out the things with that hand . \nTreatment goals:\n* work on arm and hand  functions \n* command following \n* oral motor regulation \n* colour concept \nActivities: \n* Hand wrapping\n* left sh  forward , side reachouts put the things in glass or cone \n* give take peg board activity \n* hand weight bearing \n* hand  and shoulder passive movement with stretch \n* transfer the things into right hand to left hand and put into \n* speech kit box \n* sorting activity- shape shorter \n* teach blue and red colour with reach out activities', 191, 1),
(268, 'OT Oct 2025', 'Treatment goals: \n* she is not hold one position for longer time so need to work on that \n* Her processing so fast , introduce clamming activities.\n* work on sitting ability \nActivities:\n* wrapping with wrap and sensory blanket to give deep pressure and count 1 to 100 \n* standing on sensory circuit ,take boll from floor and hit the target \n* on sitting tied knots on basket or any activity she wants to do \n* or push the boll and tracing \n* hold sensory halfmoon circuit with feet and do sorting', 25, 1),
(269, 'Larisha OT September 2k25', 'Therapy Goals\r\n1. Attention and Focus\r\n- Improve sustained attention and task completion with minimal prompts.\r\n- Develop strategies to remain engaged in structured and play-based activities.\r\n\r\n2. Eye–Hand Coordination\r\n- Enhance precision in fine motor tasks and gross motor integration.\r\n- Strengthen bilateral coordination for functional and academic activities.\r\n\r\n3. Problem-Solving and Judgment\r\n- Encourage independent decision-making and logical reasoning.\r\n- Improve sequencing, flexible thinking, and judgment in real-life and play scenarios.\r\nIntervention Plan Implemented\r\n• Structured attention-building activities using visual aids, task breakdowns, and reinforcement strategies.\r\n• Fine and gross motor coordination tasks (threading, puzzles, handwriting, ball games, obstacle courses).\r\n• Play-based learning and real-life scenarios for problem-solving and judgment.\r\n• Repetition and graded practice to reinforce concepts and improve mastery.\r\n• Parental involvement with home-based programs to encourage skill carryover.\r\nProgress & Achievements\r\n• Fine Motor Skills: Child is now able to perform fine motor activities with greater ease and sustain them for a longer duration.\r\n• Postural Control: Noticeable decrease in ‘W’ sitting posture, indicating improved core strength and body awareness.\r\n• Gross Motor Skills: Can overcome hurdles of a certain height more easily than before, showing progress in strength, balance, and coordination.\r\n• Problem-Solving: Skills remain an area of improvement, though the child demonstrates better participation and emerging independence.\r\n• Engagement in Play Therapy: Shows clear interest in play-based sessions, engages willingly, and enjoys interactive learning activities.\r\n• Task Completion: Can complete tasks with fewer verbal commands and prompts compared to earlier sessions, reflecting improved attention, compliance, and independence.', 210, 1),
(270, 'Larisha Ot October 2k25', 'Goal:- to include tasks which require more focus, to improve postural stability and  improve coordination, to improve problem solving, cognitive problem solving \nActivities/tasks/protocol:-\nHurdles involving heighted tables\nThreads and beads \nFlexion activity goals on sensory ball \nInvolve 4 piece puzzle in sitting or on wobble board \nInvolve jumping activities \nImprove lower limb strength and core strength \nImprovement:\nFine Motor Skills: Child is now able to perform fine motor activities with greater ease and sustain them for a longer duration.\r\n• Postural Control: Noticeable decrease in ‘W’ sitting posture, indicating improved core strength and body awareness.\r\n• Gross Motor Skills: Can overcome hurdles of a certain height more easily than before, showing progress in strength, balance, and coordination.\r\n• Problem-Solving: Skills remain an area of improvement, though the child demonstrates better participation and emerging independence.\r\n• Engagement in Play Therapy: Shows clear interest in play-based sessions, engages willingly, and enjoys interactive learning activities.\r\n• Task Completion: Can complete tasks with fewer verbal commands and prompts compared to earlier sessions, reflecting improved attention, compliance, and independence.', 210, 1),
(271, 'sharv ot October 2k25', 'goal : to reduce hyperactivity, reduce flapping of hands, use more prop, improve sitting tolerance without hitting anyone \nActivities: \nBlanket wrap with spike ball press over whole body for compression \nLight music \nSwing \nAdd tactile \nHand weight bearing in treadmill with peg board \nPutty search for beads use blue one hard \nWeight jacket \nNeo wraps on both the hands \nInvolve some tasks\nMake him sit next to child and gradually increase its time \nImprovement!:\nSlight reduction in flapping of hands', 143, 1),
(272, 'priyanshi ot October 2k25', 'Goal :- keep her busy as much as possible by involving physical tasks,include moving ladder,work on fine motor skills \nTasks:-\nLadder climbing and Removing clips \nSwing activities which require squatting\nTreadmill activities\nSearch and find activities \nPom pom collecting in ice cream stick and putting it in cone. \n      Improvements \nShe was able to climb the moving ladder.', 19, 1),
(273, 'Special education (November)', 'Improvement is visible:- Some sitting and concentration skills have improved/completed the vowels in hindi /table of 2 and 3/1 to 10 number names \nNow can join 4 peace puzzle \n\n[Working on]\nCommunication:-*Basic talks like about his self/school/home address/common colours,fruits, shapes,parts of the body /Week name/Months name/sense  organs \n\nCognition:-*9 peace puzzle\n                   \n                      *pattern/colour/drawing/object matching \n\nAcademic:-*Working on concentration, sitting tolerance, gripping and writing \n*Working on  व्यंजन(क से ज्ञ) \n*Table of 2, 3,4,5 and 6\n*Multiplication and addition \n*एक से बारह(oral and written)\n*1 to 50 number names \n*Two dijit addition and simple multiplication (2 to 5)\n*Introduction of subtraction and division \n*Words with help of phonic sound \n*Look at the picture and make a story', 151, 1),
(274, 'Special education (November)', 'Improvement is visible:- \n talks like about his self/school/home address/common colours,fruits, shapes,parts of the body /Week name/Months name/sense organs/Golden words/vowels/National flag-Tiranga and colour also/about traffic lights and their work /National fruit and National vegetable/can recognize and write Aa to Zz /can write 1 to 10\n\n                 [ Working on]\nSocialization:-*Mix with other kids /people \n\nCognition:-*10 to 15 peace puzzle \n                     *Dot matching and make objects \n                       *pattern/colour/drawing/object matching \n\nAcademic:-*Identification (1 to 30)/Aa to Zz \n                \n* Making letter Aa to Zz with phonic and number 1 to 20\n*Number names (one to ten)\n\n*Hindi vowels(oral and written)\n*after ,Missing and between  Numbers \n*also working on before numbers \n*Animals (domestic and wild)', 26, 1),
(275, 'Special education (November)', 'Improvement is taking place:-Now she mixes easily with children/she can make 9 peace puzzle/can recognize letters by phonic sound/knows 1 to 10 Number names/can talk about her self and common things \nSocialization:-* Working on Mix with other people \n\n[Working on]\nCommunication:-*Story telling by flash cards\n*Daily talk about her day/schedule/school/event \n\nCognition:- * 15 peace puzzle \n                    * Cube puzzle \n                    *Logical worksheets \n*Months/Week name/Shapes/Colours/Fruits/vegetables/golden words/her self/her address/sense organs/Golden words/National flag-Tiranga &colour also /about traffic lights and their work /National fruit and National vegetable\n                     \nAcademic:- *Daily Revision part\n* Working on 2 an 3 letter words \n* Number identification (1-100)\n(Written part)*Aa to Zz and 2 letter words \n                        *1 to 100\n                       *Count and write (1-50)\n*Number names (1 - 15)\n*one dijit addition \n*Before numbers/between Numbers and after numbers \n*Week name\'s spelling \n*अ से अः (oral and written)\n\n*Introduction of  क से ङ\n*Start learning about animals', 38, 1),
(276, 'Special education (November)', 'Improvement is visible:-she can recognize common colours \n[Working on]\n *sitting tolerance and Cognition \n*Learning Aa to Zz / colours and shapes \n*Scribbling and join dot to dot \n*Now working on making letter  L', 189, 1),
(277, 'Special education (November)', 'Improvement is visible:- some sitting tolerance, Identify basic colors and shapes, can recognize \nA to Z and number 1 to 10\n          [Working on]\nCommunication:- Basic talks like about his self, Identify  fruits and vegetables \n\nCognition:Identify and tell the letters with object,Identify and tell the numbers (1-20),4 peace puzzle \n\nSocialization:- Play with others\n\nAcademic:-*Scribbling and Coloring\n                      *Join dot to dot \n                      *Working on letter L and T\n\n                         *working on hand and eye coordination and sitting tolerance', 22, 1),
