(282, 'OT November 2025', 'Improvements:\n* now he is trying to talk and tell me what he wants to do with hand pointing \nTreatment goals:\n* 10-15 min session take place in the main therapy room \n* work on eye contact \n* Improve breathing pattern \n* Impulse control \nActivities: \n* sitting activity with his choice and if he doesn’t want to do let them sit for couple of time and make sure that he needs to finish this \n* Talk with him \n* 5 min treadmill walk \n* brushing\n* oral motor training \n* crawling inside the tunnel and Jump on disk with veg sorting and add diff height obstacle cross circuit to get rid of his fear and maintain our previous result \n* texture play with rice , RAjmaa beads sorting', 196, 1),
(280, 'OT November 2025', 'improvements:\n* she knows family members name .\n* she is now on what questions. showing curiosity \n* Now she tell me her choice on activities. she speaking whole sentence with therapist. \nTreatment goals: \n* work on upper an lower body strength \n* work on hand coordination and strength.\n* work on laterality - Right -Left \n* teach spatial concept - on - under \n\nActivities :\n* treadmill walk- front, side, back \n* crayons for 10 min \n* arrange boll and pom pom on fig 8 plate or tracing shape \n* Hopscotch mate with screw board game \n* push gliding stool and follow the tapping find out the things. \n* tactile play -  water play , or making shape with any texture \n* supine  to sit on boll \n* squatting activities \n* slop walking and do puzzles \n* Teach right and left discrimination', 179, 1),
(281, 'PT November-2025', 'Treatment goals: \n* work on neck , trunk control \n* work on hand weight \n\nActivities:\n* Passive movement of Ul and LL\n* facilitate Rolling - on mat and wedge in antigravity direction \n* wrap neck towel to prevent extension thrust \n* wrapping fig 8 for trunk control \n* curls up \n* side sitting hold \n* cross sitting hold \n* vishnu position hold \n* forearm support \n* 90-90 position tracing objects \n* prone on boll or plinth  in prone and side for neck control \n* half kneeling and kneeling', 170, 1),
(287, 'PT November 2025', 'Improvements: \n* she is now little bit active and taking and showing interest on session. \nTreatment goals:\n* work on neck control \n* improve postural stability and improve weight bearing capacity.\n* work on hand functions. \n* oral motor training \nActivities:\n* fig of 8 pro wrap for trunk control \n* wrap roll around neck \n* passive movement of upper and lower limb every joints\n* machine gun vibration on chest place hand on chest and apply vibration through hand \n* for neck control give three finger stroke back of neck and to do neck extension \n* vishnu position ,side sitting position ,cross sitting position hold\n* In quadruped position do pelvic rhythmic \n* Hand weight bearing on sitting \n* Weight shifting on bilateral lower limb in standing- support trunk with hand and position hold \n* starfish position \n* lizard crawling hold bilateral 10 sec hold \n* on setting chair 10 min any hand activities like taking things ,and reaching , to make her sitting valuable and encourage inner drive to do \n* Give oral motor massage with firm pressure', 234, 1),
(286, 'OT November 2025', 'Improvements:\n\nTreatment goals: \n* work on poor attention during task\n* grip strengthening \n* work on sitting ability\n* impulse control \nActivities:\n* slow rhythmic brushing proximal to distal \n* sensory bottle play\n* wrapping in sensory blanket and give deep pressure with sensory boll ,play sensory music \n* eye contact game like who holds longer time and give rewords\n* high prop activity like jumping hurdles then animal walks with give any target activity wait for sec and do it again \n* puzzle sorting in sitting \n* 1 min sitting without activity \n* 4 min relaxation activity like breathing exercises , blowing papers or session wind up', 25, 1),
(288, 'OT November 2025', 'Treatment goals: \n\n* work on eye contact- he doesn’t give sustained eye contact while talking \n* Tactile Regulation \n* poor attention on task\n* He has limited communication skills . work on his limited language \n\nActivities: \n* oral motor activity- massage , speech kit brush \n* use calming music during visual calming activity ,joint compression and boll deviation \n* High prop activity like jumping and bear walking or hopscotch activity with balance waking use pictures cards \n* shape making with diff texture or water play \n* Talk with eye contact\n* use finger brush with lemon and salt and give internal oral massage', 36, 1),
(290, 'OT November 2025', 'Treatment goals:\n* work on arm and hand  functions \n* command following \n* oral motor regulation \n* colour concept \nActivities: \n* Hand wrapping\n* left sh  forward , side reachouts put the things in glass or cone \n* give take peg board activity \n* oral massage and speech brush \n* wheelbarrow hand weight static hold . \n* hand weight bearing \n* hand  and shoulder passive movement with stretch \n* transfer the things into right hand to left hand and put into\n* sorting activity- shape shorter \n* teach blue and red colour with reach out activities', 191, 1),
(291, 'PT November 2025', 'Treatment goal: \n* work on Trunk control \n* Hand weight bearing , Hand function \nActivities: \n* Passive movement of upper and lower limb \n* wrap fig 8 to improve trunk control \n* side sitting ,cross sitting or vishnu position hold for sec \n* perturbation on siting \n* weight shifting on bolster \n* Jumping on boll and weight shifting \n* prone on plinth or do trunk extension\n* Trunk extension on standing- hold him with pelvic area and let him to do \n* crawling walking towards mom \n* quadruped position hold \n* midline Reach outs in supine or sitting for hand functions weekly 2 days \n* give and take activity parents', 242, 1),
(292, 'OT November 2025', 'Treatment goals: \n* work on sway back posture . and she is  not taking bilateral equally weights on leg .\n* sitting task for her academic oriented work  \n* brain gym activities for quickness and to maintain focus and arousal   \nActivities: \n* with discipline finish two task in sitting without and distractions and withdrawal \n* secribbling 10 min\n* Clay play activity for hand strength. and put rajma in clay and remove it \n* tracing fig 8 or arrange on that \n* Treadmill back walk with weight cuff \n* jump on colour full disk and do roll and boll - place jump disk in zig zag pattern \n* supine to sit on boll take thing-put things in  oblique directions \n* prone position on bolster and put hands on table do paper blowing activity - tuck tummy in and out \n* bilateral hand high five activity or dominoes sorting with both hands \n* squat on half moon sensory disk alternating days', 189, 1),
(294, 'SI / OT plans for November', 'goals:\neye contact\ncommand follow.\nimprove hyperactiveness.\nbody awareness.\n\nActivites\n\nsensory Regulation\n\nBrushing\n\n-Ball compression, joint\n\ncompression, Ball deviation\n\nVibration\n\nfront back gentle stylm swing.\n\nmidline & body awarness\n\nTunnel Chawling & obstacle course\n\n→) communication & antention(sitting activites)\n\nSensory - cognitive & fine motor Grains, clay etc.', 147, 1),
(295, 'OT plan for the month of November 2025', 'Monthly Goals:same as last month \n\nIncrease sitting tolerance during structured table-top activities.\n\nReduce hyperactive and escape behaviours (e.g., running, irrelevant talk) through sensory regulation.\n\nImprove attention and task completion during therapist-directed or motor-based activities.\n\nTherapy Activities for This Month 1. Sensory Regulation Activities\n\nBrushing and joint compression.\n\nDeep pressure or wrapping with weighted blanket or lycra sheet.\n\nHeavy work tasks:\n\nPushing/pulling weighted box or therapy ball.\n\nWall push-ups, animal walks (bear walk/crab walk).\n\n2. Attention & Sitting Activities\n\nVisual schedule (First Then method: \"First work, then swing\").\n\nShort, engaging table-top tasks:\n\nPegboard or shape sorting\n\nTracing, simple puzzle, or beading\n\nSorting coins, buttons, or colour tokens\n\n3. Controlled Movement Activities: To channel hyperactivity positively:\n\nSwing activity (linear, gentle)-3-5 minutes for vestibular input.\n\nTrampoline \"jump and stop\" game improves impulse control.\n\nObstacle course\n\ncrawl jump\n\nstop carry item.\n\nTreadmill or rhythmic ball dribbling to release excess energy.', 237, 1),
(296, 'OT/ SI plan for November', 'Achieved.                                           improved eye contact.                                      improved command follow.                    This month goal                               1) continue last month                    2) improve sensory tolerance/ textures.                                              3) improve sitting tolerance             4) improve hyperactiveness             Activities                                            brushing followed by joint compression and wall compression.                                    wrapping with ball compression.        sensory grains/ textures.                 lygra swing.                                           beer walk or animal walk.                hand walking on treadmill.', 199, 1),
(297, 'OT plan for November', 'Goals\n1) To improve isolated shoulder movement with minimal scapular compensation.\n\n2) To increase elbow extension range and control.\n\n3) To enhance finger opening and functional grasp–release pattern.\n\n4) To improve forearm supination up to near full range.\n\n5) To improve upright sitting posture and trunk stability during upper limb activity.                           Therapy Plan\n\n1. Neurofacilitation & Postural Control                                                 2) Upper Limb Facilitation.               3. Sensory & Strengthening Activities: \nWeight-bearing through extended upper limbs (prone on elbows → extended arms).\n\nUse putty, sponge squeezing, or towel wringing for grip strengthening.\n\nBrushing and joint compression for tone regulation before activity.\n\n4. Functional Integration\nBimanual tasks (holding bottle, opening lid, pushing/pulling objects).\n\nAdapted play with toys encouraging bilateral coordination.', 23, 1),
(298, 'OT plan for November', 'OT Goals\n\nTo improve ability to follow and remember 2–3 step sequences during structured tasks.\n\nTo enhance attention span and focus\n\nTo improve bilateral coordination and midline crossing through brain gym exercises.\n\nTo enhance visual–motor coordination and planning during play-based or table-top activities.\n\nTo increase organization and sequencing in daily functional activities.                             .            Treatment Plan\n\n1. Cognitive Sequencing Activities\n\nPicture sequencing or story cards.\n\n“Simon Says” with 2–3 step commands.\n\nStep-by-step games (arranging, matching, following order).\n\nPractising daily routine steps (brushing, packing bag) in order.\n\n2. Brain Gym & Coordination Exercises\n\nCross crawl, lazy eight tracing, hook-ups.                                      3. Memory & Attention Training\n\nVisual and auditory memory games (“What’s missing?”, memory cards).\n\nRepeat and recall short words, numbers, or objects.\n\nMatching patterns or finding differences in pictures.\n\nShort structured tasks with small breaks to build sitting tolerance.\n\n4. Visual–Motor and Fine Motor Activities\n5. Functional Integration Tasks\n\nUse of “First–Then” visual schedule (e.g., “First writing, then play”).\n\nSequencing daily self-care activities like dressing or brushing.\n\nEncourage verbal rehearsal of steps before performing a task.', 38, 1),
(299, 'test', 'test...', 145, 1),
(300, 'PT plan for the November', 'Goal \n\n1) To improve sitting and standing balance with symmetrical weight-bearing \n2) reduce falls during daily movements.\n\n🔹 Management \n1. Postural Alignment (in Sitting & Standing)\n\nUse chair with back support and side supports → encourage midline sitting.\n\nin standing → ask her to \"sit straight like a soldier.\"\n\nIn standing, give verbal/tactile cue: “stand tall, knees straight.”\n\nUse stable surface support (table, wall, parallel bar).\n\n2. Balance Training\n\nSitting balance:\n\nPass a lightweight ball side-to-side while sitting.\n\nStanding balance: Standing with feet apart, hold table/wall → shift weight gently left-right, forward-backward.\n\nOne leg standing with support \n\nGradually reduce hand support.\n\n3. Strengthening & Stretching \n\nSit-to-stand from chair\n\nknee extensions in sitting as well as standing.\n\nMarching in place (holding support).\n\nStretching tight muscles: hamstrings, calf, hip flexors, abductor and adductors', 37, 1),
(301, 'OT November 2025', 'Treatment Goals:\n* To regulate sensory arousal and meet sensory needs.\n* To improve adaptability to transitions and play activities.\n* To enhance eye contact and social engagement.\n\nActivities:\n* Begin the session by making the child comfortable through playful interaction.\n* Avoid carrying him; instead, encourage independent exploration of the environment and active engagement in play.\n* Use calming background music or therapist-led singing with rhythmic movements such as gentle bouncing or jumping on the therapy ball.\n* Provide sensory input through brushing and joint compression techniques.\n* Include gross motor play such as stair climbing and slope walking to improve balance and body awareness.\n* During moments of refusal or resistance (e.g., when the child does not want to play or asks to be picked up), redirect attention by offering a simple task like removing clips from a ladder to re-engage participation', 247, 1),
(302, 'PT November 2025', 'Improvements: \n* He is holding position for couple of time. \nTreatment goals :\n* work on inappropriate hand flapping \n* work on independent sitting and posture control .\nActivities: \n* Wrapping fig of 8 for trunk control\n* stretching of feet for clubfoot \n* Quadruped position on bolster \n* vishnu position hold \n* sit to stand on bolster \n* half kneel to standing \n* side sitting with hand weight bearing if he cooperate then add sorting and putting things side \n* step standing on bolster \n* (any three day of week)Standing on standing bar and midline reachouts', 186, 1),
(303, 'parents meeting', 'ABA and school rediness, cycling training we need to do, pre writing skill not writing', 179, 1),
