(305, 'Special education (December)', 'Improvement is taking place:-Now she mixes  with children/ can make 9 peace puzzle/can recognize letters by phonic sound/knows 1 to 10 Number names/can talk about her self and common things /she knows National flag-Tiranga, vegetable,fruit,bird\nWritten part:- Aa to Zz with phonic sound/1 to 50 numbers/अ से अः (स्वर)/after numbers \nSocialization:-* Working on Mix with other people \n\n[Working on]\nCommunication:-*Story telling by flash cards\n*Daily talk about her day/schedule/school/event \n\nCognition:- * 15 peace puzzle \n                    * Cube puzzle \n                    *Logical worksheets \n*Months/Week name/Shapes/Colours/golden words/her self/her address/sense organs/ about traffic lights and their work /National dress and animal \n                     \nAcademic:- *Daily Revision part\n* Working on 2 an 3 letter words (a sound)\n* Number identification (1-100)\n(Written part)*Aa to Zz and 2 and 3 letter words \n                        *1 to 100\n                       *Count and write (1-100)\n*Number names (1 - 15)\n*one dijit addition(Introduction)\n*Before numbers/between Numbers and after numbers \n*Week name\'s spelling \n*Introduction of  क से ङ\n*Introduction of vowels \n*1 to 10 numbers in hindi (or', 38, 1),
(306, 'special education (December)', 'Improvement is visible:- Some sitting and concentration skills have improved/completed the vowels in hindi /table of 2,3,4 and 5 /1 t0 20 number name \nNow can join 4 peace puzzle with help/\nNow he is trying to recite a small story from any picture /can read,write and recognize अ से न/\n\n[Working on]\nCommunication:-*Basic talks like about his self/school/home address/common colours,fruits, shapes,parts of the body /Week name/Months name/sense  organs /vowels /traffic signal/National symbols \n\nCognition:-*9 peace puzzle\n                   \n                      *pattern/colour/drawing/object matching \n\nAcademic:-*Working on concentration, sitting tolerance, gripping and writing \n*Working on  व्यंजन(प से ज्ञ) \n*दो अक्षर के शब्द\n*Revision of Table 2, 3,4,5 \n*Working on table of 6 and 7\n*Multiplication and addition \n*एक से बीस(oral)\n*1 to 100 number names \n*Two dijit addition and simple multiplication (2 to 5)\n*Introduction of subtraction and division \n*Words with help of phonic sound \n*Look at the picture and make a story \n*Introduction of hindi matra', 151, 1),
(307, 'Special education (December)', 'Improvement is visible:- some sitting tolerance, Identify basic colors and shapes, can recognize \nA to Z and number 1 to 10\nCan make A \n          [Working on]\nCommunication:- Basic talks like about his self, Identify  fruits and vegetables \n\nCognition:Identify and tell the letters with object,Identify and tell the numbers (1-20),4 peace puzzle \n\nSocialization:- Play with others\n\nAcademic:-*Scribbling and Coloring\n                      *Join dot to dot and make letter L\n                      *Match the letters with picture \n\n                         *working on hand and eye coordination and sitting tolerance', 22, 1),
(308, 'Special education (December)', 'Improvement is visible:- some sitting tolerance, Identify basic colors and shapes, can recognize \nA to Z and number 1 to 10\nCan make A \n          [Working on]\nCommunication:- Basic talks like about his self, Identify  fruits and vegetables \n\nCognition:Identify and tell the letters with object,Identify and tell the numbers (1-20),4 peace puzzle \n\nSocialization:- Play with others\n\nAcademic:-*Scribbling and Coloring\n                      *Join dot to dot and make letter L\n                      *Match the letters with picture \n\n                         *working on hand and eye coordination and sitting tolerance', 22, 1),
(309, 'special education (December)', 'Improvement is visible:-she can recognize common colours and now she can make letter L\n[Working on]\n *sitting tolerance and Cognition \n*Learning Aa to Zz / colours and shapes \n*Scribbling and join dot to dot \n*Working on letter T', 189, 1);
